INSERT INTO `dx_topic` VALUES (1,'yii2框架安装篇','谢谢支持，我会抽时间编辑',1,13,1468747418,1474444806,0),(3,'Composer 使用小技巧','抽时间编辑',1,13,1473048543,1474444820,0),(4,'yii配置','改天有时间再编辑',2,13,1473243634,1474444778,0),(6,'新手报到，多多指教！','本人php程序员一枚！',4,15,1473484177,1473484177,0),(7,'yii2 composer安装日历插件，安装失败，大侠们，这是怎么回事？','  1 在安装完成之后，在cmd里面输入composer，出现一个图案。意思应该是安装成功了。\r\n  2 composer require kartik-v/yii2-widget-datetimepicker \"*\"，用这个安装日历插件，然后报错了。\r\n该怎么解决',3,16,1473581715,1473581715,0),(8,'高级PHP工程师（主程）','######岗位职责： \r\n1. 负责公司app和网站的后台架构设计，底层开发，功能模块设计，核心代码与技术难点编程工作。完成各类产品功能实现、迭代升级。 \r\n2. 对程序员分配工作，审核代码，并且协助团队后端PHP工程师成长。 \r\n3. 对策划提出的各种设计需求的技术可行性进行评估和技术更正 \r\n\r\n######岗位要求： \r\n1. 计算机相关专业大专以上学历, 3年以上PHP开发经验，能够独立开发中等以上规模的网站。 \r\n2. 熟练掌握PHP+MYSQL编程，熟悉常见ThinkPHP，Zend，YII等PHP开发框架，熟悉MVC设计模式 \r\n3. 熟悉关系型数据库SQL语言，MySQL主从开发、索引优化、查询优化和存储优化，以及PHP缓存、静态化等技术； \r\n4. 熟悉操作Linux系统，能单独完成分布式集群式服务器部署，站点架设，安全设置等操作； \r\n5. 熟练应用GIT等进行协作开发，有撰写设计文档的习惯，有带过后端php团队开发经验； \r\n6、必须拥有良好的代码习惯，能编写高质量代码，要求结构清晰，命名规范，逻辑性强，代码冗余率低； \r\n7、熟悉并开发过大并发大吞吐量的项目者优先； \r\n\r\n######其他要求： \r\n1. 具备良好的专业意识，爱学习，爱专研，注重系统安全及语言的性能；\r\n2. 具备强烈的进取心、求知欲及团队合作精神，有较强的沟通及协调能力，高度的工作责任心和敬业精神，人品佳； \r\n3. 具备独自发现问题和解决问题能力，自学能力强。 \r\n\r\n\r\n\r\n######福利待遇： \r\n1. 薪资结构 基本薪资+绩效奖金+补贴+五险一金+年终奖金 基本薪资：面议（高于市场水平） \r\n2. 上班时间9：00--17：30，不加班，周末双休，享受法定节假日以及相应节日福利，工作氛围轻松愉悦； \r\n3. 公司男女员工比例协调，经常组织聚餐、拓展等社交媒体活动； \r\n4. 每周有固定的下午茶时间，公司提供水果福利和其他小零食； \r\n5. 每年享有2-3次的国内外旅游，开阔视野，增长见识。 \r\n\r\n联系QQ：1535760795',1,20,1474268742,1474268742,0),(9,'招聘2年以上PHP工程师/PHP程序员','######岗位职责：\r\n1.  负责PHP程序模块的设计，开发，测试\r\n2. 网站产品和网站功能模块的开发与维护\r\n3. 有编写Javascript和HTML能力，熟悉常用的CMS\r\n4. 负责网站服务器PHP环境搭建与维护\r\n5. 能独立完成网站功能布局设计和数据库设计\r\n\r\n\r\n######任职要求：\r\n1. 有责任心，工作努力，执行力强，有团队合作精神；\r\n2. 有2年以上PHP开发经验；\r\n3. 有开源网站二次开发经验的，写过开源程序插件类程序。\r\n\r\n\r\n######公司介绍：\r\n公司主要业务是运营http://www.3dmgame.com/（三大妈）等等国内知名网站。\r\n\r\n公司地址：上海市闵行区新源路1356号汇力得产业园区C座911、913、915、918\r\n\r\n联系QQ：824791088',1,22,1474279862,1474280366,0),(10,'高薪招聘php','简历请发至hr@banmatrip.com\r\n\r\n\r\n公司名称：上海歌晨信息技术有限公司\r\n\r\n公司地址：上海市浦东新区博霞路22号403室	\r\n\r\n招聘类别：社会招聘\r\n\r\n招聘职位：PHP开发工程师\r\n\r\n工作性质：全职\r\n\r\n薪资范围：10-20k\r\n\r\n招聘人数：5\r\n\r\n工作职责:\r\n\r\n    1、开发公司官方网站/微信公众号/APP服务器端等；\r\n\r\n    2、开发公司业务支撑系统；\r\n\r\n    3、相关系统需求分析、系统设计，完成相应的技术文档；\r\n\r\n    4、沟通需求和开发中遇到的相关问题，团队协作；\r\n\r\n    5、参与技术评审，参与制定产品开发规范。\r\n\r\n任职资格：\r\n\r\n    1、全日制重点本科及以上计算机相关专业，一年以上LAMP开发经验；\r\n\r\n    2、熟练掌握PHP，熟悉PHP框架，熟悉编程规范；\r\n\r\n    3、熟练掌握MySQL或其他大型数据库使用，了解基本数据库设计和SQL调优；\r\n\r\n    4、熟悉Linux/UNIX等操作系统，了解常用命令；\r\n\r\n    5、熟悉DIV+CSS/JavaScript技术，熟悉jQuery等框架；\r\n\r\n    6、责任心强，具有良好的沟通能力和学习能力。\r\n',1,23,1474279950,1474279950,0),(11,'招聘1个3--5年的PHP研发，薪资20k','\r\n1. 大学计算机相关专业大专及以上学历\r\n2. 3年到5年php开发经验；\r\n3. 基于CodeIgniter、Pimple,Curl开发过项目为佳；\r\n4. 熟悉PHP环境下Redis和memcache的开发。\r\n5. 熟悉Linux操作系统，熟悉Shell脚本编程及常用Linux操作命令；\r\n6. 熟悉MYSQL，熟悉配置、维护、性能优化；熟悉各种条件查询，复合查询等的编写能力；并有良好的数据设计能力；\r\n7. 熟悉HTTP协议及W3C相关互联网规范，熟练掌握XHTML、CSS、DIV、JavaScript等页面技术；\r\n8. 具有NGINX、PHP扩展模块开发经验优先；\r\n9、有较好的学习能力和极强的沟通协调能力,能承受工作压力;',1,26,1474885275,1474885275,0),(12,'招聘3--5年的php研发攻城狮一枚 薪资15--20k','大学计算机相关专业大专及以上学历\r\n3年到5年php开发经验；\r\n基于CodeIgniter、Pimple,Curl开发过项目为佳；\r\n熟悉PHP环境下Redis和memcache的开发。\r\n熟悉Linux操作系统，熟悉Shell脚本编程及常用Linux操作命令；\r\n熟悉MYSQL，熟悉配置、维护、性能优化；熟悉各种条件查询，复合查询等的编写能力；并有良好的数据设计能力；\r\n熟悉HTTP协议及W3C相关互联网规范，熟练掌握XHTML、CSS、DIV、JavaScript等页面技术；\r\n具有NGINX、PHP扩展模块开发经验优先；\r\n有较好的学习能力和极强的沟通协调能力,能承受工作压力。\r\n\r\n联系方式 ：1873411662@qq.com',1,26,1474892311,1474892311,0),(13,'求技术经理，坐标杭州','#####岗位名称：技术经理\r\n\r\n#####岗位职能：\r\n\r\n1. 公司核心产品的架构设计与实现，与研发团队及产品团队紧密配合，参与业务分析、需求分析、架构设计、技术决策以及详细设计，满足业务快速发展的需要；\r\n2. 负责核心系统的架构设计，重构、优化现有的技术架构\r\n3. 解决重要项目中的关键架构问题和技术难题，负责项目中关键技术难点的攻关和预研，对开发团队进行技术指导和培训，规范开发流程\r\n4. 带领团队攻克如高并发、高可用等带来的各种挑战及技术难关；\r\n5. 把握整体系统的设计，确保系统的架构质量，确保多系统稳定、高效运行；\r\n6. 探索通过实践验证的开源技术产品，并将其成功地应用到业务系统中；\r\n\r\n\r\n#####岗位要求：\r\n1. 5年或以上精通PHP或JAVA开发的经验，对相关技术领域的开源产品有深入的理解\r\n2. 熟悉大数据分析、缓存技术、搜索技术、异步框架、集群与负载均衡、消息系统、信息安全等领域\r\n3. 计算机及相关专业本科及以上学历；\r\n4. 具备较强的逻辑思维、沟通技巧、管理能力\r\n5. 有数据分析类或医院服务类相关开发经验者优先\r\n\r\n#####薪资：18K-26K（具体面议）\r\n',1,27,1475049211,1475049617,0),(14,'上海乐蜀招聘PHP','######职位描述：\r\n1. 设计，编码，测试，文档记录；\r\n2. 网站产品和功能的技术开发和实施、产品的测试和调整；\r\n3. 与设计人员配合，将设计开发成产品；\r\n4. 与项目经理配合，详细了解并实现需求；\r\n5. 与架构设计师配合，对模块进行设计和开发；\r\n6. 与测试人员配合，了解并解决产品中存在的问题；\r\n7. 成为团队中一员，融入到团队中。\r\n\r\n\r\n######任职条件：\r\n1. 具有扎实的计算机基础理论知识，最好提供相关计算机证书；\r\n2. 具有大型互联网应用设计、开发经验；\r\n3. 精通PHP语言程序开发，至少两年以上PHP开发工作经验，熟悉PHP框架类产品；\r\n4. 熟悉MVC、OOA、OOP编程思想，深入了解PHP的性能最优化和安全最大化，有良好的程序构架设计以及编程风格和注释习惯，精通CGI标准和HTTP等互联网协议；\r\n5. 掌握相关Web开发技术，有一年以上web2.0开发经验者优先；熟练掌握HTML语言、JavaScript脚本语言、XML、CSS、Ajax、div等页面技术；\r\n6. 熟练mysql配置操作；有linux下c、c++开发经验者优先；\r\n7. 熟悉软件设计流程和软件工程规范，具备良好而规范的设计和技术文档编写能力。\r\n\r\n地址：上大路1号文景楼7F（地铁7号线上大路出来就到）\r\n\r\n待遇：月薪12K-17K，其他详谈\r\n\r\n公司网站  leshu.com.cn\r\nQ6230888，暗号PHP即可。',1,28,1475054320,1475056033,0),(16,'yii 启用model的方法 ','yii 启用model的方法 ',3,29,1476179543,1476435631,5),(17,' Session变量不能传送到下一页.解决: session.use_trans_sid = 1','在PHP中使用过SESSION的朋友可能会碰到这么一个问题，SESSION变量不能跨页传递。这令我苦恼了好些日子，最终通过查资料思考并解决了这个问题。我认为，出现这个问题的原因有以下几点： \r\n1、客户端禁用了cookie \r\n2、浏览器出现问题，暂时无法存取cookie \r\n3、php.ini中的session.use_trans_sid = 0或者编译时没有打开--enable-trans-sid选项\r\n\r\n为什么会这样呢？下面我解释一下：\r\n\r\nSession储存于服务器端（默认以文件方式存储session），根据客户端提供的session id来得到用户的文件，取得变量的值，session id可以使用客户端的Cookie或者Http1.1协议的Query_String（就是访问的URL的“?”后面的部分）来传送给服务器，然后服务器读取Session的目录……。也就是说，session id是取得存储在服务上的session变量的身份证。当代码session_start();运行的时候，就在服务器上产生了一个session文件，随之也产生了与之唯一对应的一个session id，定义session变量以一定形式存储在刚才产生的session文件中。通过session id，可以取出定义的变量。跨页后，为了使用session，你必须又执行session_start();将又会产生一个session文件，与之对应产生相应的session id，用这个session id是取不出前面提到的第一个session文件中的变量的，因为这个session id不是打开它的“钥匙”。如果在session_start();之前加代码session_id($session id);将不产生新的session文件，直接读取与这个id对应的session文件。\r\n\r\nPHP中的session在默认情况下是使用客户端的Cookie来保存session id的,所以当客户端的cookie出现问题的时候就会影响session了。必须注意的是：session不一定必须依赖cookie，这也是session相比cookie的高明之处。当客户端的Cookie被禁用或出现问题时，PHP会自动把session id附着在URL中,这样再通过session id就能跨页使用session变量了。但这种附着也是有一定条件的，即“php.ini中的session.use_trans_sid = 1或者编译时打开打开了--enable-trans-sid选项”。\r\n\r\n用过论坛的朋友都知道，在进入论坛的时候，往往会提示你检查Cookie是否打开，这是因为大多数论坛都是基于Cookie的，论坛用它来保存用户名、密码等用户信息，方便使用。而且很多朋友都认为Cookie不安全（其实不是这样），往往禁用它。其实在PHP程序中，我们完全可以用SESSION来代替Cookie，它可以不依赖于客户端是否开启Cookie。\r\n\r\n所以，我们可以抛开cookie使用session,即假定用户关闭cookie的情况下使用session，其实现途径有以下几种：\r\n\r\n1、设置php.ini中的session.use_trans_sid = 1或者编译时打开打开了--enable-trans-sid选项，让PHP自动跨页传递session id。 \r\n2、手动通过URL传值、隐藏表单传递session id。 \r\n3、用文件、数据库等形式保存session_id,在跨页过程中手动调用。\r\n\r\n途径1举例说明：\r\n\r\ns1.php\r\n\r\n<?php \r\nsession_start(); \r\n$_SESSION[’var1’]=\"中华人民共和国\"; \r\n$url=\"<a href=\".\"\"s2.php\">下一页</a>\"; \r\necho $url; \r\n?>\r\n\r\ns2.php\r\n<pre><code>\r\n<?php \r\nsession_start(); \r\necho \"传递的session变量var1的值为：\".$_SESSION[’var1’]; \r\n?>\r\n</pre></code>\r\n运行以上代码，在客户端cookie正常的情况下，应该可以在得到结果“中华人民共和国”。 \r\n现在你手动关闭客户端的cookie，再运行，可能得不到结果了吧。如果得不到结果，再“设置php.ini中的session.use_trans_sid = 1或者编译时打开打开了--enable-trans-sid选项”，又得到结果“中华人民共和国”\r\n\r\n \r\n\r\n途径2举例说明：\r\n\r\ns1.php\r\n<pre><code>\r\n<?php \r\nsession_start(); \r\n$_SESSION[’var1’]=\"中华人民共和国\"; \r\n$sn = session_id(); \r\n$url=\"<a href=\".\"\"s2.php?s=\".$sn.\"\">下一页</a>\"; \r\necho $url; \r\n?>\r\n</pre></code>\r\n\r\ns2.php\r\n<pre><code>\r\n<?php \r\nsession_id($_GET[’s’]); \r\nsession_start(); \r\necho \"传递的session变量var1的值为：\".$_SESSION[’var1’]; \r\n?>\r\n</pre></code>\r\n隐藏表单的方法基本原理同上。\r\n\r\n途径3举例说明：\r\n\r\nlogin.html\r\n<pre><code>\r\n<!DOCTYPE HTML PUBLIC \"-//W3C//DTD HTML 4.01 Transitional//EN\"> \r\n<html> \r\n<head> \r\n<title>Login</title> \r\n<meta http-equiv=\"Content-Type\" content=\"text/html; charset=gb2312\"> \r\n</head> \r\n<body> \r\n请登录： \r\n<form name=\"login\" method=\"post\" action=\"mylogin1.php\"> \r\n用户名:<input type=\"text\" name=\"name\"><br> \r\n口　令:<input type=\"password\" name=\"pass\"><br> \r\n<input type=\"submit\" value=\"登录\"> \r\n</form> \r\n</body> \r\n</html>\r\n</pre></code>\r\n\r\nmylogin1.php\r\n<pre><code>\r\n<?php\r\n\r\n$name=$_POST[’name’]; \r\n$pass=$_POST[’pass’]; \r\nif(!$name || !$pass) { \r\necho \"用户名或密码为空，请<a href=\"login.html\">重新登录</a>\"; \r\ndie(); \r\n} \r\nif (!($name==\"youngong\" && $pass==\"123\") { \r\necho \"用户名或密码不正确，请<a href=\"login.html\">重新登录</a>\"; \r\ndie(); \r\n} \r\n//注册用户 \r\nob_start(); \r\nsession_start(); \r\n$_SESSION[’user’]= $name; \r\n$psid=session_id(); \r\n$fp=fopen(\"e:/tmp/phpsid.txt\",\"w+\"; \r\nfwrite($fp,$psid); \r\nfclose($fp); \r\n//身份验证成功，进行相关操作 \r\necho \"已登录<br>\"; \r\necho \"<a href=\"mylogin2.php\">下一页</a>\";\r\n\r\n?>\r\n</code></pre>\r\n\r\n\r\nmylogin2.php\r\n<pre><code>\r\n<?php \r\n$fp=fopen(\"e:/tmp/phpsid.txt\",\"r\"; \r\n$sid=fread($fp,1024); \r\nfclose($fp); \r\nsession_id($sid); \r\nsession_start(); \r\nif(isset($_SESSION[’user’]) && $_SESSION[’user’]=\"laogong\" {\r\n\r\necho \"已登录!\"; \r\n} \r\nelse { \r\n//成功登录进行相关操作 \r\necho \"未登录，无权访问\"; \r\necho \"请<a href=\"login.html\">登录</a>后浏览\"; \r\ndie(); \r\n}\r\n\r\n?>\r\n</code></pre>\r\n同样请关闭cookie测试，用户名：youngong 密码：123 这是通过文件保存session id的，文件是：e: mpphpsid.txt，请根据自己的系统决定文件名或路径。\r\n\r\n至于用数据库的方法，我就不举例子了，与文件的方法类似。\r\n\r\n总结一下，上面的方法有一个共同点，就是在前一页取得session id，然后想办法传递到下一页，在下一页的session_start();代码之前加代码session_id(传过来的session id); \r\n====================================================================\r\n',4,13,1482304597,1482304597,0),(18,' Session变量不能传送到下一页.解决: session.use_trans_sid = 1','在PHP中使用过SESSION的朋友可能会碰到这么一个问题，SESSION变量不能跨页传递。这令我苦恼了好些日子，最终通过查资料思考并解决了这个问题。我认为，出现这个问题的原因有以下几点： \r\n1、客户端禁用了cookie \r\n2、浏览器出现问题，暂时无法存取cookie \r\n3、php.ini中的session.use_trans_sid = 0或者编译时没有打开--enable-trans-sid选项\r\n\r\n为什么会这样呢？下面我解释一下：\r\n\r\nSession储存于服务器端（默认以文件方式存储session），根据客户端提供的session id来得到用户的文件，取得变量的值，session id可以使用客户端的Cookie或者Http1.1协议的Query_String（就是访问的URL的“?”后面的部分）来传送给服务器，然后服务器读取Session的目录……。也就是说，session id是取得存储在服务上的session变量的身份证。当代码session_start();运行的时候，就在服务器上产生了一个session文件，随之也产生了与之唯一对应的一个session id，定义session变量以一定形式存储在刚才产生的session文件中。通过session id，可以取出定义的变量。跨页后，为了使用session，你必须又执行session_start();将又会产生一个session文件，与之对应产生相应的session id，用这个session id是取不出前面提到的第一个session文件中的变量的，因为这个session id不是打开它的“钥匙”。如果在session_start();之前加代码session_id($session id);将不产生新的session文件，直接读取与这个id对应的session文件。\r\n\r\nPHP中的session在默认情况下是使用客户端的Cookie来保存session id的,所以当客户端的cookie出现问题的时候就会影响session了。必须注意的是：session不一定必须依赖cookie，这也是session相比cookie的高明之处。当客户端的Cookie被禁用或出现问题时，PHP会自动把session id附着在URL中,这样再通过session id就能跨页使用session变量了。但这种附着也是有一定条件的，即“php.ini中的session.use_trans_sid = 1或者编译时打开打开了--enable-trans-sid选项”。\r\n\r\n用过论坛的朋友都知道，在进入论坛的时候，往往会提示你检查Cookie是否打开，这是因为大多数论坛都是基于Cookie的，论坛用它来保存用户名、密码等用户信息，方便使用。而且很多朋友都认为Cookie不安全（其实不是这样），往往禁用它。其实在PHP程序中，我们完全可以用SESSION来代替Cookie，它可以不依赖于客户端是否开启Cookie。\r\n\r\n所以，我们可以抛开cookie使用session,即假定用户关闭cookie的情况下使用session，其实现途径有以下几种：\r\n\r\n1、设置php.ini中的session.use_trans_sid = 1或者编译时打开打开了--enable-trans-sid选项，让PHP自动跨页传递session id。 \r\n2、手动通过URL传值、隐藏表单传递session id。 \r\n3、用文件、数据库等形式保存session_id,在跨页过程中手动调用。\r\n\r\n途径1举例说明：\r\n\r\ns1.php\r\n\r\n<?php \r\nsession_start(); \r\n$_SESSION[’var1’]=\"中华人民共和国\"; \r\n$url=\"<a href=\".\"\"s2.php\">下一页</a>\"; \r\necho $url; \r\n?>\r\n\r\ns2.php\r\n<pre><code>\r\n<?php \r\nsession_start(); \r\necho \"传递的session变量var1的值为：\".$_SESSION[’var1’]; \r\n?>\r\n</pre></code>\r\n运行以上代码，在客户端cookie正常的情况下，应该可以在得到结果“中华人民共和国”。 \r\n现在你手动关闭客户端的cookie，再运行，可能得不到结果了吧。如果得不到结果，再“设置php.ini中的session.use_trans_sid = 1或者编译时打开打开了--enable-trans-sid选项”，又得到结果“中华人民共和国”\r\n\r\n \r\n\r\n途径2举例说明：\r\n\r\ns1.php\r\n<pre><code>\r\n<?php \r\nsession_start(); \r\n$_SESSION[’var1’]=\"中华人民共和国\"; \r\n$sn = session_id(); \r\n$url=\"<a href=\".\"\"s2.php?s=\".$sn.\"\">下一页</a>\"; \r\necho $url; \r\n?>\r\n</pre></code>\r\n\r\ns2.php\r\n<pre><code>\r\n<?php \r\nsession_id($_GET[’s’]); \r\nsession_start(); \r\necho \"传递的session变量var1的值为：\".$_SESSION[’var1’]; \r\n?>\r\n</pre></code>\r\n隐藏表单的方法基本原理同上。\r\n\r\n途径3举例说明：\r\n\r\nlogin.html\r\n<pre><code>\r\n<!DOCTYPE HTML PUBLIC \"-//W3C//DTD HTML 4.01 Transitional//EN\"> \r\n<html> \r\n<head> \r\n<title>Login</title> \r\n<meta http-equiv=\"Content-Type\" content=\"text/html; charset=gb2312\"> \r\n</head> \r\n<body> \r\n请登录： \r\n<form name=\"login\" method=\"post\" action=\"mylogin1.php\"> \r\n用户名:<input type=\"text\" name=\"name\"><br> \r\n口　令:<input type=\"password\" name=\"pass\"><br> \r\n<input type=\"submit\" value=\"登录\"> \r\n</form> \r\n</body> \r\n</html>\r\n</pre></code>\r\n\r\nmylogin1.php\r\n<pre><code>\r\n<?php\r\n\r\n$name=$_POST[’name’]; \r\n$pass=$_POST[’pass’]; \r\nif(!$name || !$pass) { \r\necho \"用户名或密码为空，请<a href=\"login.html\">重新登录</a>\"; \r\ndie(); \r\n} \r\nif (!($name==\"youngong\" && $pass==\"123\") { \r\necho \"用户名或密码不正确，请<a href=\"login.html\">重新登录</a>\"; \r\ndie(); \r\n} \r\n//注册用户 \r\nob_start(); \r\nsession_start(); \r\n$_SESSION[’user’]= $name; \r\n$psid=session_id(); \r\n$fp=fopen(\"e:/tmp/phpsid.txt\",\"w+\"; \r\nfwrite($fp,$psid); \r\nfclose($fp); \r\n//身份验证成功，进行相关操作 \r\necho \"已登录<br>\"; \r\necho \"<a href=\"mylogin2.php\">下一页</a>\";\r\n\r\n?>\r\n</code></pre>\r\n\r\n\r\nmylogin2.php\r\n<pre><code>\r\n<?php \r\n$fp=fopen(\"e:/tmp/phpsid.txt\",\"r\"; \r\n$sid=fread($fp,1024); \r\nfclose($fp); \r\nsession_id($sid); \r\nsession_start(); \r\nif(isset($_SESSION[’user’]) && $_SESSION[’user’]=\"laogong\" {\r\n\r\necho \"已登录!\"; \r\n} \r\nelse { \r\n//成功登录进行相关操作 \r\necho \"未登录，无权访问\"; \r\necho \"请<a href=\"login.html\">登录</a>后浏览\"; \r\ndie(); \r\n}\r\n\r\n?>\r\n</code></pre>\r\n同样请关闭cookie测试，用户名：youngong 密码：123 这是通过文件保存session id的，文件是：e: mpphpsid.txt，请根据自己的系统决定文件名或路径。\r\n\r\n至于用数据库的方法，我就不举例子了，与文件的方法类似。\r\n\r\n总结一下，上面的方法有一个共同点，就是在前一页取得session id，然后想办法传递到下一页，在下一页的session_start();代码之前加代码session_id(传过来的session id); \r\n====================================================================\r\n',4,13,1482304617,1482304617,0),(19,'php7.10 session.auto_start忘记打开','>做了微信端程序，布置到服务器上面之后，点开公众号下面的菜单，结果一直在跳转当中;\r\n最后找到原因，是因为程序session没有保存成功造成的。\r\n\r\n>步骤\r\n1. 先是开启  session.use_trans_sid =1（ 可以在页面之间传递session变量）  不成功\r\n2. 后来检测了保存session的文件夹，权限是777                                                 不成功\r\n3. 最后打开了session.auto_start=1                                                                        终于ok\r\n结论：写代码前要用init_set强制打开一下session.start(); ',4,13,1482309324,1482462799,0),(20,'php之catch_workers_output = yes','打开php-fpm.conf    \r\n增加\r\n[www]\r\ncatch_workers_output = yes',4,13,1482311597,1482311597,0),(21,'HTML meta viewport属性说明(mark)','\r\n什么是Viewport\r\n手机浏览器是把页面放在一个虚拟的“窗口”（viewport）中，通常这个虚拟的“窗口”（viewport）比屏幕宽，这样就不用把每个网页挤到很小的窗口中（这样会破坏没有针对手机浏览器优化的网页的布局），用户可以通过平移和缩放来看网页的不同部分。移动版的 Safari 浏览器最新引进了 viewport 这个 meta tag，让网页开发者来控制 viewport 的大小和缩放，其他手机浏览器也基本支持。\r\n\r\n \r\n\r\nViewport 基础\r\n一个常用的针对移动网页优化过的页面的 viewport meta 标签大致如下：\r\n\r\n<meta name=”viewport” content=”width=device-width, initial-scale=1, maximum-scale=1″>\r\n\r\nwidth：控制 viewport 的大小，可以指定的一个值，如果 600，或者特殊的值，如 device-width 为设备的宽度（单位为缩放为 100% 时的 CSS 的像素）。\r\nheight：和 width 相对应，指定高度。\r\ninitial-scale：初始缩放比例，也即是当页面第一次 load 的时候缩放比例。\r\nmaximum-scale：允许用户缩放到的最大比例。\r\nminimum-scale：允许用户缩放到的最小比例。\r\nuser-scalable：用户是否可以手动缩放\r\n\r\n \r\n\r\n关于viewport的一些问题\r\nviewport并非只是ios上的独有属性，在android、winphone上同样也有viewport。它们要解决的问题是相同的，即无视设备的真实分辨率，直接通过dpi，在物理尺寸和浏览器之间重设分辨率，这个分辨率和设备的分辨率无关。比如，你拿个3.5寸-320 * 480的iphone3 gs、3.5寸-640 * 960的iphone4或者9.7寸-1024*768的ipad2，虽然设备的分辨率不同,物理尺寸也不同，但你可以通过设置viewport让它们在浏览器里有相同的分辨率。比如说，你的网站是800px宽，你可以通过设置viewport的width=800，来让你的网站在这三个不同的设备上都刚好满屏显示你的网站。\r\n\r\n \r\n\r\n以上的知识，相信每个对viewport稍有了解的同学应该都已经了解了。这不是我今天想说的重点。我想说明的是viewport在ios和android上的一些差异表现。\r\n\r\n \r\n\r\n网上一搜关于viewport的知识，基本上全都是如下信息：\r\n\r\n<meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0, maximum-scale=1.0, minimum-scale=1.0, user-scalable=no\" />\r\n\r\n这段代码的意思是，让viewport的宽度等于物理设备上的真实分辨率，不允许用户缩放。一都主流的web app都是这么设置的，它的作用其实是故意舍弃viewport，不缩放页面，这样dpi肯定和设备上的真实分辨率是一样的，不做任何缩放，网页会因此显得更高细腻。玩ps的同学应该都知道，当你将一张1000 * 1000的图片直接缩放至500 * 500分变成什么样，对吧？图片的失真一定逃不掉。\r\n\r\n \r\n\r\n但我要做的一个应用却恰恰相反，需要利用viewport，利用缩放。不论真实分辨率是多少，无论物理尺寸是多少，我都希望在浏览器里，能有统一的分辨率，同时也不允许用户缩放。我用来测试的设备有：iphone4、ipad2、htc的g11、不知道什么厂商的aquos phone（android系统）、华硕的android pad、dell的winphone然后我一路遇到了如下问题：\r\n\r\n \r\n\r\n1）如果不显示地设置viewport，那么width的默认为980。如果页面的所有元素宽度都小于980，此时width为980，如果页面最宽的位置超过980，那么width等于最大宽度。总之，默认能将整个页面从左到右显示出来。如果设置了viewport，比如，只单纯地设置了user-scalable=no，例如<meta name=\"viewport\" content=\"user-scalable=no\" />，那么ios下width还是按980显示（即默认就会通过dpi缩放），但android和winphone下却不会再缩放了，浏览器分辨率和真实设置分辨率一致。\r\n\r\n \r\n\r\n2）对于ios设备，设置width可以生效，但对于android，设置width并不会生效。ios设备，缩放的比率即dpi是通过你设置的width和设置真实分辨率自动计算的，而android下你设置width无效，你能设置的是一个特殊的字段target-densitydpi，关于target-densitydpi可以参考一下这篇文章：http://hi.baidu.com/j_fo/blog/item/748361279ebccd18908f9d7d.html。也就是说，有三个变量：浏览器width、设备真实width、dpi。 我们简单地用个公式来表达它们之间的关系吧（并非真实关系，简单说明用） 设备真实width * dpi = 浏览器width，这里的三个变量，设备真实width是个我们不能操作的已知值，另外两个变量我们可以设置一个来影响另一个，在ios中，我们能改的是浏览器width，dpi自动生成，而在android中，我们能改的是dpi，浏览器width自动生成。对于android，无论我们如何设置width，也不会对浏览器width产生影响。\r\n\r\n \r\n\r\nps：这里我另外再说一个奇怪的问题：在htc的g11里（htc的手机我只有这一个，别的没有测），如果设置了dpi而不显示地设置width，则user-scalable=no不生效，即是说：<meta name=\"viewport\" content=\"target-densitydpi=300,user-scalable=no\" />，无法阻止用户缩放屏幕。我们需要显示地设置一下width值，仅管这个值对android下的浏览器分辨屏并不产生任何影响（对ios还是会产生影响的），我们仍然要设置它，而且这个值一定要大于320，如果小于等于320，也无法使user-scalable=no生效。这个问题只在htc的g11手机上出现，在aquos phone没有这个问题。兼容android真是件头痛的事 @_@，未来还不知道有多少坑呢。而在winphone上，结果就更奇怪了：我给viewport的width设一个大于480的值，user-scalable=no就失效了，而设一个小于480的值，user-scalable=no能生效。但无论我给viewport的width设多少值，对winphone真正显示的width却并不产生我预期的影响，通过target-densitydpi也没有影响。设置width，如果小于480的话，屏幕会缩放，但缩小的比例却和我预期完全不一样，我不知道它是按照什么规律缩放的。不知道这是winphone的问题，还是dell实现的问题。\r\n\r\n \r\n\r\n3）这一条和上一条应该是直接相关的：ios设备在横竖屏时，会自动调整dpi，无论横屏还是竖屏，都能保证浏览器width等于viewport中设置的值，所以横竖屏的时候，页面里显示的内容的大小是会自动缩放产生变化的。而android手机在横竖屏的时候，不会改变dpi，在横竖屏的时候，网页不会产生缩放。也正因此，ios可以保证横竖屏页面都不会产生滚动条，满屏显示，而android却无法保证这一点，横着满屏则竖着无法满屏，反之亦然。\r\n\r\n \r\n\r\n4）对于ios设备，如果width显示定义了，而页面最宽的位置超过width的话，width无效，仍按最宽的宽度来显示（不会有滚动条）。但此时会出现一个很奇怪的问题，当你将手机横竖屏切换几次之后，会发现你的页面自动放大了，出现了滚动条，但其实放大后的宽度其实和你设的width也并没有关系。为了防止这种情况出现，你需要将width的宽度设置得比页面最宽的地方更大，或者相同。',4,13,1482313050,1482313050,0),(22,'centos 关机和重启命令详解','如果你很急着关机或者重启话，那么关机就是init 0，重启就是init 6或者reboot\r\nLinux中常用的关机和重新启动命令有shutdown、halt、reboot以及init，它们都可以达到关机和重新启动的目的，但是每个命令的内部工作过程是不同的，下面将逐一进行介绍。\r\n\r\n1. shutdown\r\nshutdown命令用于安全关闭Linux系统。有些用户会使用直接断掉电源的方式来关闭Linux，这是十分危险的。因为Linux与Windows不同，其后台运行着许多进程，所以强制关机可能会导致进程的数据丢失，使系统处于不稳定的状态，甚至会损坏硬件设备。\r\n执行shutdown命令时，系统会通知所有登录的用户系统将要关闭，并且login指令会被冻结，即新的用户不能再登录系统。使用shutdown命令可 以直接关闭系统，也可以延迟指定的时间再关闭系统，还可以重新启动。延迟指定的时间再关闭系统，可以让用户有时间储存当前正在处理的文件和关闭已经打开的 程序。\r\n\r\n    shutdown命令的部分参数如下：\r\n    [-t] 指定在多长时间之后关闭系统\r\n    [-r] 重启系统\r\n    [-k] 并不真正关机，只是给每个登录用户发送警告信号\r\n    [-h] 关闭系统（halt）\r\n\r\n    shutdown命令的工作实质是给init程序发送信号（signal），要求其切换系统的运行级别（Runlevel）。系统的运行级别包括：\r\n\r\n    0：关闭系统\r\n    1：单用户模式，如果没有为shutdown命令指定-h或-r参数而直接执行，则默认将切换到此运行级别\r\n    2：多用户模式（不支持NFS）\r\n    3：多用户模式（支持NFS），一般常用此种运行级别\r\n    5：多用户模式（GUI模式）\r\n    6：重新启动系统\r\n\r\n2. halt\r\n    halt是最简单的关机命令，其实际上是调用shutdown -h命令。halt执行时，杀死应用进程，文件系统写操作完   成后就会停止内核。\r\n\r\n    halt命令的部分参数如下：\r\n    [-f] 没有调用shutdown而强制关机或重启\r\n    [-i] 关机或重新启动之前，关掉所有的网络接口\r\n    [-p] 关机时调用poweroff，此选项为缺省选项\r\n\r\n3. reboot\r\nreboot的工作过程与halt类似，其作用是重新启动，而halt是关机。其参数也与halt类似。\r\n\r\n4. init\r\ninit是所有进程的祖先，其进程号始终为1。init用于切换系统的运行级别，切换的工作是立即完成的。init 0命令用于立即将系统运行级别切换为0，即关机；init 6命令用于将系统运行级别切换为6，即重新启动。',4,13,1482462143,1482462143,0),(23,'SSH超时断开的解决办法','打开 /etc/ssh/sshd_config \r\n\r\n* 找到 ClientAliveInterval 参数，如果没有就自己加一行 \r\n数值是秒，比如你设置为540，就是9分钟. \r\nClientAliveInterval 540 \r\n* ClientAliveCountMax \r\n    指如果发现客户端没有相应，则判断一次超时，这个参数设置允许超时的次数，比如10 \r\n\r\n    ClientAliveInterval 540\r\n\r\n    ClientAliveCountMax 10; \r\n\r\n    则代表允许超时 5400秒 = 90分钟 \r\n\r\n\r\n* service sshd restart 重启服务',4,13,1482462484,1482462629,0),(24,'nginx upstream的分配方式','1、轮询（默认）\r\n每个请求按时间顺序逐一分配到不同的后端服务器，如果后端服务器down掉，能自动剔除。\r\n2、weight\r\n指定轮询几率，weight和访问比率成正比，用于后端服务器性能不均的情况。\r\n例如：\r\nupstream bakend {\r\nserver 192.168.159.10 weight=10;\r\nserver 192.168.159.11 weight=10;\r\n}\r\n\r\n3、ip_hash\r\n每个请求按访问ip的hash结果分配，这样每个访客固定访问一个后端服务器，可以解决session的问题。\r\n例如：\r\nupstream resinserver{\r\nip_hash;\r\nserver 192.168.159.10:8080;\r\nserver 192.168.159.11:8080;\r\n}\r\n\r\n4. fair（第三方）\r\n按后端服务器的响应时间来分配请求，响应时间短的优先分配。\r\nupstream resinserver{\r\nserver server1;\r\nserver server2;\r\nfair;\r\n}\r\n\r\n5、url_hash（第三方）\r\n按访问url的hash结果来分配请求，使每个url定向到同一个后端服务器，后端服务器为缓存时比较有效。\r\n例：在upstream中加入hash语句，server语句中不能写入weight等其他的参数，hash_method是使用的hash算法\r\n\r\nupstream resinserver{\r\nserver squid1:3128;\r\nserver squid2:3128;\r\nhash $request_uri;\r\nhash_method crc32;\r\n}\r\ntips:\r\n \r\nupstream resinserver{#定义负载均衡设备的Ip及设备状态\r\nip_hash;\r\nserver 127.0.0.1:8000 down;\r\nserver 127.0.0.1:8080 weight=2;\r\nserver 127.0.0.1:6801;\r\nserver 127.0.0.1:6802 backup;\r\n}\r\n在需要使用负载均衡的server中增加\r\nproxy_pass http://resinserver/;\r\n\r\n每个设备的状态设置为:\r\n1.down 表示单前的server暂时不参与负载\r\n2.weight 默认为1.weight越大，负载的权重就越大。\r\n3.max_fails ：允许请求失败的次数默认为1.当超过最大次数时，返回proxy_next_upstream 模块定义的错误\r\n4.fail_timeout:max_fails次失败后，暂停的时间。\r\n5.backup： 其它所有的非backup机器down或者忙的时候，请求backup机器。所以这台机器压力会最轻。\r\nnginx支持同时设置多组的负载均衡，用来给不用的server来使用。\r\nclient_body_in_file_only 设置为On 可以讲client post过来的数据记录到文件中用来做debug\r\nclient_body_temp_path 设置记录文件的目录 可以设置最多3层目录\r\nlocation 对URL进行匹配.可以进行重定向或者进行新的代理 负载均衡',4,13,1482488604,1482488604,0),(25,'mysql开启严格模式','开启严格模式的意义就不用我说了。\r\n\r\n通过修改MySQL的配置文件，在配置文件中的[mysqld]组下面查找sql-mode，将此行修改成为：\r\n\r\nsql-mode=\"STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION\"',4,13,1482593752,1482593752,0),(26,'mysql 导出表一些参数','mysql 导出表一些参数\r\n\r\nmysqldump  --all-database --single-transaction  -ignore-table=mysql.* -uroot -p密码 > /root/all_databases.sql\r\n\r\n--single-transaction  不到出正在提交中的数据\r\n--ignore-table  排除某个表\r\n\r\n更详细: http://imysql.cn/2008_10_24_deep_into_mysqldump_options\r\n',4,13,1482650715,1482651153,0),(27,'通过设置nginx的client_max_body_size解决nginx+php上传大文件的问题','通过设置nginx的client_max_body_size解决nginx+php上传大文件的问题： \r\n\r\n用nginx来做webserver的时，上传大文件时需要特别注意client_max_body_size这个参数,否则会中断在nginx的请求中,在php中是无法记录到访问的. \r\n\r\n一般上传大文件流程： \r\n\r\n首先修改php.ini文件： \r\n\r\n参数 设置 说明 \r\n\r\nfile_uploads on 是否允许通过HTTP上传文件的开关。默认为ON即是开 \r\n\r\nupload_tmp_dir – 文件上传至服务器上存储临时文件的地方，如果没指定就会用系统默认的临时文件夹 \r\n\r\nupload_max_filesize 8m 望文生意，即允许上传文件大小的最大值。默认为2M \r\n\r\npost_max_size 8m 指通过表单POST给PHP的所能接收的最大值，包括表单里的所有值。默认为8M \r\n\r\n说明 \r\n\r\n一般来说，设置好上述四个参数后，在网络正常的情况下，上传<=8M的文件是不成问题的 \r\n\r\n但如果要上传>8M的大文件的话，只设置上述四项还不一定能行的通。除非你的网络真有100M/S的上传高速，否则你还得继续设置下面的参数。 \r\n\r\nmax_execution_time 600 每个PHP页面运行的最大时间值(秒)，默认30秒 \r\n\r\nmax_input_time 600 每个PHP页面接收数据所需的最大时间，默认60秒 \r\n\r\nmemory_limit 8m 每个PHP页面所吃掉的最大内存，默认8M \r\n\r\n但是还是不行，因为的webserver用的是nginx， google了一下，发现在nginx的conf中添加了一个参数： \r\n默认是1M，需要增大的话\r\n\r\n在nginx.conf中增加一句 \r\n\r\nclient_max_body_size 30m; \r\n\r\n重启即可 \r\n\r\n30m表示最大上传30M，需要多大设置多大。',4,13,1482719566,1482719566,0),(28,'概念了解：CGI，FastCGI，PHP-CGI与PHP-FPM','CGI\r\n\r\nCGI全称是“公共网关接口”(Common Gateway Interface)，HTTP服务器与你的或其它机器上的程序进行“交谈”的一种工具，其程序须运行在网络服务器上。\r\n\r\nCGI可以用任何一种语言编写，只要这种语言具有标准输入、输出和环境变量。如php,perl,tcl等。\r\n\r\nFastCGI\r\n\r\nFastCGI像是一个常驻(long-live)型的CGI，它可以一直执行着，只要激活后，不会每次都要花费时间去fork一次（这是CGI最为人诟病的fork-and-execute 模式）。它还支持分布式的运算，即 FastCGI 程序可以在网站服务器以外的主机上执行并且接受来自其它网站服务器来的请求。\r\n\r\nFastCGI是语言无关的、可伸缩架构的CGI开放扩展，其主要行为是将CGI解释器进程保持在内存中并因此获得较高的性能。众所周知，CGI解释器的反复加载是CGI性能低下的主要原因，如果CGI解释器保持在内存中并接受FastCGI进程管理器调度，则可以提供良好的性能、伸缩性、Fail- Over特性等等。\r\n\r\nFastCGI特点\r\n\r\nFastCGI具有语言无关性.\r\nFastCGI在进程中的应用程序，独立于核心web服务器运行，提供了一个比API更安全的环境。APIs把应用程序的代码与核心的web服务器链接在一起，这意味着在一个错误的API的应用程序可能会损坏其他应用程序或核心服务器。 恶意的API的应用程序代码甚至可以窃取另一个应用程序或核心服务器的密钥。\r\nFastCGI技术目前支持语言有：C/C++、Java、Perl、Tcl、Python、SmallTalk、Ruby等。相关模块在Apache, ISS, Lighttpd等流行的服务器上也是可用的。\r\nFastCGI的不依赖于任何Web服务器的内部架构，因此即使服务器技术的变化, FastCGI依然稳定不变。\r\n\r\nFastCGI的工作原理\r\n\r\nWeb Server启动时载入FastCGI进程管理器（IIS ISAPI或Apache Module)\r\n\r\nFastCGI进程管理器自身初始化，启动多个CGI解释器进程(可见多个php-cgi)并等待来自Web Server的连接。\r\n当客户端请求到达Web Server时，FastCGI进程管理器选择并连接到一个CGI解释器。Web server将CGI环境变量和标准输入发送到FastCGI子进程php-cgi。\r\n\r\nFastCGI子进程完成处理后将标准输出和错误信息从同一连接返回Web Server。当FastCGI子进程关闭连接时，请求便告处理完成。FastCGI子进程接着等待并处理来自FastCGI进程管理器(运行在Web Server中)的下一个连接。 在CGI模式中，php-cgi在此便退出了。\r\n\r\n在上述情况中，你可以想象CGI通常有多慢。每一个Web请求PHP都必须重新解析php.ini、重新载入全部扩展并重初始化全部数据结构。使用FastCGI，所有这些都只在进程启动时发生一次。一个额外的好处是，持续数据库连接(Persistent database connection)可以工作。\r\n\r\nFastCGI的不足\r\n\r\n因为是多进程，所以比CGI多线程消耗更多的服务器内存，PHP-CGI解释器每进程消耗7至25兆内存，将这个数字乘以50或100就是很大的内存数。\r\n\r\nNginx 0.8.46+PHP 5.2.14(FastCGI)服务器在3万并发连接下，开启的10个Nginx进程消耗150M内存（15M*10=150M），开启的64个php-cgi进程消耗1280M内存（20M*64=1280M），加上系统自身消耗的内存，总共消耗不到2GB内存。如果服务器内存较小，完全可以只开启25个php-cgi进程，这样php-cgi消耗的总内存数才500M。\r\n\r\n上面的数据摘自Nginx 0.8.x + PHP 5.2.13(FastCGI)搭建胜过Apache十倍的Web服务器(第6版)\r\n\r\nPHP-CGI\r\n\r\nPHP-CGI是PHP自带的FastCGI管理器。\r\n\r\nPHP-CGI的不足：\r\n\r\nphp-cgi变更php.ini配置后需重启php-cgi才能让新的php-ini生效，不可以平滑重启。\r\n直接杀死php-cgi进程，php就不能运行了。(PHP-FPM和Spawn-FCGI就没有这个问题，守护进程会平滑从新生成新的子进程。）\r\nPHP-FPM\r\n\r\nPHP-FPM是一个PHP FastCGI管理器，是只用于PHP的，可以在 http://php-fpm.org/download下载得到。\r\n\r\nPHP-FPM其实是PHP源代码的一个补丁，旨在将FastCGI进程管理整合进PHP包中。必须将它patch到你的PHP源代码中，在编译安装PHP后才可以使用。\r\n\r\n现在我们可以在最新的PHP 5.3.2的源码树里下载得到直接整合了PHP-FPM的分支，据说下个版本会融合进PHP的主分支去。相对Spawn-FCGI，PHP-FPM在CPU和内存方面的控制都更胜一筹，而且前者很容易崩溃，必须用crontab进行监控，而PHP-FPM则没有这种烦恼。\r\n\r\nPHP5.3.3已经集成php-fpm了，不再是第三方的包了。PHP-FPM提供了更好的PHP进程管理方式，可以有效控制内存和进程、可以平滑重载PHP配置，比spawn-fcgi具有更多有点，所以被PHP官方收录了。在./configure的时候带 –enable-fpm参数即可开启PHP-FPM。\r\n\r\nSpawn-FCGI\r\n\r\nSpawn-FCGI是一个通用的FastCGI管理服务器，它是lighttpd中的一部份，很多人都用Lighttpd的Spawn-FCGI进行FastCGI模式下的管理工作，不过有不少缺点。而PHP-FPM的出现多少缓解了一些问题，但PHP-FPM有个缺点就是要重新编译，这对于一些已经运行的环境可能有不小的风险(refer)，在php 5.3.3中可以直接使用PHP-FPM了。\r\n\r\nSpawn-FCGI目前已经独成为一个项目，更加稳定一些，也给很多Web 站点的配置带来便利。已经有不少站点将它与nginx搭配来解决动态网页。\r\n\r\n最新的lighttpd也没有包含这一块了(http://www.lighttpd.net/search?q=Spawn-FCGI)，但可以在以前版本中找到它。在lighttpd-1.4.15版本中就包含了(http://www.lighttpd.net/download/lighttpd-1.4.15.tar.gz)，目前Spawn-FCGI的下载地址是http://redmine.lighttpd.net/projects/spawn-fcgi，最新版本是http://www.lighttpd.net/download/spawn-fcgi-1.6.3.tar.gz。\r\n\r\n注：最新的Spawn-FCGI可以到lighttpd.net网站搜索“Spawn-FCGI”找到它的最新版本发布地址。\r\n\r\n\r\n\r\nPHP-FPM与spawn-CGI对比\r\n\r\nPHP-FPM的使用非常方便，配置都是在PHP-FPM.ini的文件内，而启动、重启都可以从php/sbin/PHP-FPM中进行。更方便的是修改php.ini后可以直接使用PHP-FPM reload进行加载，无需杀掉进程就可以完成php.ini的修改加载\r\n结果显示使用PHP-FPM可以使php有不小的性能提升。PHP-FPM控制的进程cpu回收的速度比较慢,内存分配的很均匀。\r\nSpawn-FCGI控制的进程CPU下降的很快，而内存分配的比较不均匀。有很多进程似乎未分配到，而另外一些却占用很高。可能是由于进程任务分配的不均匀导致的。而这也导致了总体响应速度的下降。而PHP-FPM合理的分配，导致总体响应的提到以及任务的平均',4,13,1482719729,1482719729,0),(29,'180多个PHP常用内置函数','PHP常用函数总结\r\n\r\n数学函数\r\n\r\n1. abs(): 求绝对值\r\n<pre><code> $abs = abs(-4.2); //4.2 数字绝对值数字 </code></pre>\r\n\r\n2. ceil(): 进一法取整\r\n<pre><code>echo ceil(9.999); // 10 浮点数进一取整</code></pre>\r\n\r\n3. floor(): 舍去法取整\r\n     <pre><code>echo floor(9.999); // 9 浮点数直接舍去小数部分</code></pre>\r\n\r\n4. fmod(): 浮点数取余\r\n<pre><code>\r\n     $x = 5.7;\r\n     $y = 1.3; // 两个浮点数,x>y 浮点余数\r\n     $r = fmod($x, $y);\r\n     // $r equals 0.5, because 4 * 1.3 + 0.5 = 5.7 \r\n</pre></code>\r\n\r\n5. pow(): 返回数的n次方\r\n    <pre><code>echo pow(-1, 20); // 1 基础数|n次方乘方值</pre></code>\r\n\r\n6. round(): 浮点数四舍五入\r\n    <pre><code>echo round(1.95583, 2); // 1.96, 一个数值|保留小数点后多少位,默认为0 舍入后的结果</pre></code>\r\n\r\n7. sqrt(): 求平方根\r\n    <pre><code>echo sqrt(9); //3 被开方的数平方根</pre></code>\r\n\r\n8. max(): 求最大值\r\n    <pre><code>echo max(1, 3, 5, 6, 7); // 7</pre></code>\r\n多个数字或数组 返回其中的最大值\r\n    <pre><code>echo max(array(2, 4, 5)); // 5</pre></code>\r\n\r\n9. min(): 求最小值\r\n输入: 多个数字或数组\r\n输出: 返回其中的最小值\r\n\r\n10. mt_rand(): 更好的随机数\r\n输入: 最小|最大, 输出: 随机数随机返回范围内的值\r\n   <pre><code> echo mt_rand(0,9);//n</code></pre>\r\n\r\n11. rand(): 随机数 输入: 最小|最大, 输出: 随机数随机返回范围内的值\r\n\r\n12. pi(): 获取圆周率值\r\n\r\n  去空格或或其他字符:\r\n\r\n13. trim(): 删除字符串两端的空格或其他预定义字符\r\n<pre><code>\r\n$str = \"\\r\\nHello World!\\r\\n\";\r\necho trim($str);</pre></code>\r\n输入: 目标字符串 返回值: 清除后的字符串\r\n\r\n14. rtrim(): 删除字符串右边的空格或其他预定义字符\r\n<pre><code>\r\n$str = \"Hello World!\\n\\n\";\r\necho rtrim($str);\r\n</code></pre>\r\n\r\n15. chop(): rtrim()的别名\r\n\r\n16. ltrim(): 删除字符串左边的空格或其他预定义字符\r\n<pre><code>\r\n$str = \"\\r\\nHello World!\";\r\necho ltrim($str);\r\n</code></pre>\r\n\r\n17. dirname(): 返回路径中的目录部分\r\n    <pre><code>echo dirname(\"c:/testweb/home.php\");  //c:/testweb</code></pre>\r\n输入: 一个包含路径的字符串 返回值: 返回文件路径的目录部分\r\n\r\n字符串生成与转化：　　\r\n\r\n18. str_pad(): 把字符串填充为指定的长度\r\n<pre><code>$str = \"Hello World\";\r\necho str_pad($str,20,\".\");\r\n</code></pre>\r\n输入: 要填充的字符串|新字符串的长度|供填充使用的字符串, 默认是空白\r\n\r\n输出: 完成后的字符串\r\n\r\n19. str_repeat(): 重复使用指定字符串\r\n   <pre><code> echo str_repeat(\".\",13); // 要重复的字符串|字符串将被重复的次数13个点</code></pre>\r\n\r\n20. str_split(): 把字符串分割到数组中\r\n<pre><code>print_r(str_split(\"Hello\"));</code></pre>\r\n输入: 要分割的字符串|每个数组元素的长度，默认1\r\n输出: 拆分后的字符串数组\r\n\r\n21. strrev(): 反转字符串\r\n    <pre><code>echo strrev(\"Hello World!\"); // !dlroW olleH</code></pre>\r\n输出: 目标字符串颠倒顺序后的字符串\r\n\r\n22. wordwrap(): 按照指定长度对字符串进行折行处理\r\n<pre><code>$str = \"An example on a long word is:\r\nSupercalifragulistic\";\r\necho wordwrap($str,15);\r\n</code></pre>\r\n输入: 目标字符串|最大宽数\r\n输出: 折行后的新字符串\r\n\r\n23. str_shuffle(): 随机地打乱字符串中所有字符\r\n    <pre><code>echo str_shuffle(\"Hello World\");</code></pre>\r\n输入: 目标字符串顺序 输出: 打乱后的字符串\r\n\r\n24. parse_str(): 将字符串解析成变量\r\n<pre><code>parse_str(\"id=23&name=John%20Adams\", $myArray);\r\nprint_r($myArray);\r\n</code></pre>\r\n输入: 要解析的字符串|存储变量的数组名称\r\n输出: 返回Array( [id] => 23 [name] => John Adams)\r\n\r\n25. number_format(): 通过千位分组来格式化数字 输入: 要格式化的数字|规定多少个小数|规定用作小数点的字符 串|规定用作千位分隔符的字符串\r\n输出: 1,000,000 1,000,000.00 1.000.000,00\r\n\r\n大小写转换：\r\n26. strtolower(): 字符串转为小写\r\n    <pre><code>echo strtolower(\"Hello WORLD!\");\r\n</code></pre>\r\n目标字符串 小写字符串\r\n27. strtoupper(): 字符串转为大写\r\n    <pre><code>echo strtoupper(\"Hello WORLD!\");</code></pre>\r\n\r\n输出: 大写字符串\r\n28. ucfirst(): 字符串首字母大写\r\n   <pre><code> echo ucfirst(\"hello world\"); //　Hello world</code></pre>\r\n\r\n29. ucwords(): 字符串每个单词首字符转为大写\r\n    <pre><code>echo ucwords(\"hello world\"); //　Hello World</code></pre>\r\n\r\nhtml标签关联:\r\n30. htmlentities(): 把字符转为HTML实体\r\n<pre><code>$str = \"John & \'Adams\'\";\r\necho htmlentities($str, ENT_COMPAT); // John & \'Adams\'</code></pre>\r\n\r\n31. htmlspecialchars(): 预定义字符转html编码\r\n\r\n32. nl2br(): \\n转义为<br>标签\r\n   <pre><code> echo nl2br(\"One line.\\nAnother line.\");</code></pre>\r\n\r\n输出: 处理后的字符串\r\n33. strip_tags(): 剥去 HTML、XML 以及 PHP 的标签\r\n    <pre><code>echo strip_tags(\"Hello <b>world!</b>\"); 　</code></pre>\r\n\r\n34. addcslashes():在指定的字符前添加反斜线转义字符串中字符\r\n<pre><code>$str = \"Hello, my name is John Adams.\";\r\necho $str;\r\necho addcslashes($str,\'m\');\r\n</code></pre>\r\n\r\n输入: 目标字符串|指定的特定字符或字符范围\r\n35. stripcslashes(): 删除由addcslashes()添加的反斜线\r\n   <pre><code> echo stripcslashes(\"Hello, \\my na\\me is Kai Ji\\m.\");\r\n    // 目标字符串 Hello, my name is Kai Jim.\r\n</code></pre>\r\n\r\n36. addslashes(): 指定预定义字符前添加反斜线\r\n   <pre><code> $str = \"Who\'s John Adams?\";\r\necho addslashes($str);\r\n</code></pre>\r\n输出: 把目标串中的\' \" \\和null进行转义处理\r\n\r\n37. stripslashes(): 删除由addslashes()添加的转义字符\r\n   <pre><code> echo stripslashes(\"Who\\\'s John Adams?\"); // 清除转义符号Who\'s John Adams?</code></pre>\r\n\r\n38.quotemeta(): 在字符串中某些预定义的字符前添加反斜线\r\n<pre><code>$str = \"Hello world. (can you hear me?)\";\r\necho quotemeta($str);\r\n //　Hello world\\. \\(can you hear me\\?\\)</code></pre>\r\n\r\n39. chr(): 从指定的 ASCII 值返回字符\r\n    <pre><code>echo chr(052); // ASCII 值返回对应的字符</code></pre>\r\n\r\n40. ord(): 返回字符串第一个字符的ASCII值\r\n   <pre><code> echo ord(\"hello\"); 字符串第一个字符的 ASCII 值</code></pre>\r\n\r\n字符串比较：\r\n41. strcasecmp(): 不区分大小写比较两字符串\r\n   <pre><code> echo strcasecmp(\"Hello world!\",\"HELLO WORLD!\");</code></pre>\r\n\r\n输入: 两个目标字符串 输出: 大1|等0|小 -1\r\n42. strcmp(): 区分大小写比较两字符串\r\n\r\n43. strncmp(): 比较字符串前n个字符,区分大小写\r\n<pre><code>\r\n调用: int strncmp ( string $str1 , string $str2 , int $len) 　</code></pre>\r\n\r\n 44. strncasecmp(): 比较字符串前n个字符,不区分大小写\r\n<pre><code>调用: int strncasecmp ( string $str1 , string $str2 , int $len )</code></pre>\r\n\r\n45. strnatcmp(): 自然顺序法比较字符串长度,区分大小写\r\n<pre><code>\r\n调用: int strnatcmp ( string $str1 , string $str2 )</code></pre>\r\n\r\n输入: 目标字符串　\r\n46. strnatcasecmp(): 自然顺序法比较字符串长度, 不区分大小写\r\n\r\n调用: int strnatcasecmp ( string $str1 , string $str2 )\r\n\r\n字符串切割与拼接：\r\n\r\n47. chunk_split()：将字符串分成小块\r\n\r\n调用: str chunk_split(str $body[,int $len[,str $end]])\r\n\r\n输入: $body目标字串, $len长度, $str插入结束符 输出: 分割后的字符串\r\n\r\n48. strtok(): 切开字符串\r\n\r\n调用: str strtok(str $str,str $token)\r\n\r\n目标字符串$str，以$token为标志切割返回切割后的字符串\r\n\r\n49. explode(): 使用一个字符串为标志分割另一个字符串\r\n\r\n调用: array explode(str $sep,str $str[,int $limit])\r\n输入: $sep为分割符,$str目标字符串,$limit返回数组最多包含元素数 输出: 字符串被分割后形成的数组\r\n\r\n50. implode(): 同join,将数组值用预订字符连接成字符串\r\n\r\n调用: string implode ( string $glue , array $pieces )\r\n\r\n$glue默认, 用\'\'则直接相连\r\n\r\n51. substr(): 截取字符串\r\n\r\n调用: string substr ( string $string , int $start [, int $length ] )\r\n\r\n\r\n字符串查找替换：\r\n\r\n52. str_replace(): 字符串替换操作,区分大小写\r\n\r\n调用mix str_replace(mix $search,mix $replace, mix $subject[,int &$num])\r\n\r\n输入: $search查找的字符串,$replace替换的字符串,$subject被查找字串, &$num 输出: 返回替换后的结果\r\n\r\n53. str_ireplace() 字符串替换操作,不区分大小写\r\n\r\n调用: mix str_ireplace ( mix $search , mix $replace , mix $subject [, int &$count ] )\r\n\r\n输入: $search查找的字符串,$replace替换的字符串,$subject被查找字串,&$num 输出: 返回替换后的结果\r\n\r\n54. substr_count(): 统计一个字符串,在另一个字符串中出现次数\r\n\r\n调用: int substr_count ( string $haystack , string $needle[, int $offset = 0 [, int $length ]] )\r\n\r\n55. substr_replace(): 替换字符串中某串为另一个字符串\r\n\r\n调用: mixed substr_replace ( mixed $string, string $replacement,int $start [, int $length ] )\r\n\r\n56. similar_text(): 返回两字符串相同字符的数量\r\n\r\n调用: int similar_text(str $str1,str $str2)\r\n\r\n输入: 两个比较的字符串\r\n\r\n输出: 整形,相同字符数量\r\n\r\n57. strrchr(): 返回一个字符串在另一个字符串中最后一次出现位置开始到末尾的字符串\r\n\r\n调用: string strrchr ( string $haystack , mixed $needle )\r\n\r\n58. strstr(): 返回一个字符串在另一个字符串中开始位置到结束的字符串\r\n\r\n调用: string strstr ( string $str, string $needle , bool $before_needle ) 　　\r\n\r\n 59. strchr(): strstr()的别名,返回一个字符串在另一个字符串中首次出现的位置开始到末尾的字符串\r\n\r\n调用: string strstr ( string $haystack , mixed $needle [, bool $before_needle = false ] ) 　\r\n　\r\n60. stristr(): 返回一个字符串在另一个字符串中开始位置到结束的字符串，不区分大小写\r\n\r\n调用:string stristr ( string $haystack , mixed $needle [, bool $before_needle = false ] )\r\n\r\n61. strtr(): 转换字符串中的某些字符\r\n\r\n调用: string strtr ( string $str , string $from , string $to )\r\n\r\n62. strpos(): 寻找字符串中某字符最先出现的位置\r\n\r\n调用: int strpos ( string $haystack , mixed $needle [, int $offset = 0 ] )\r\n\r\n63. stripos(): 寻找字符串中某字符最先出现的位置,不区分大小写 \r\n\r\n调用: int stripos ( string $haystack , string $needle [, int $offset ] )\r\n\r\n64. strrpos(): 寻找某字符串中某字符最后出现的位置\r\n\r\n调用: int strrpos ( string $haystack , string $needle [, int $offset = 0 ] )\r\n\r\n65. strripos(): 寻找某字符串中某字符最后出现的位置,不区分大小写\r\n\r\n调用: int strripos ( string $haystack , string $needle [, int $offset ] )\r\n\r\n66. strspn(): 返回字符串中首次符合mask的子字符串长度 \r\n\r\n调用: int strspn ( string $str1 , string $str2 [, int $start [, int $length ]] )\r\n\r\n67. strcspn(): 返回字符串中不符合mask的字符串的长度\r\n\r\n调用: int strcspn ( string $str1 , string $str2 [, int $start [, int $length ]] )\r\n输入: $str1被查询,$str2查询字符串，$start开始查询的字符，$length是查询长度 输出: 返回从开始到第几个字符\r\n\r\n字符串统计：\r\n\r\n68. str_word_count(): 统计字符串含有的单词数\r\n\r\n调用: mix str_word_count(str $str,[])\r\n\r\n输入: 目标字符串 输出: 统计处的数量\r\n\r\n69. strlen(): 统计字符串长度int strlen(str $str)\r\n\r\n输入: 目标字符串 输出:整型长度\r\n\r\n70. count_chars(): 统计字符串中所有字母出现次数(0..255) \r\n\r\n调用: mixed count_chars ( string $string [, int $mode ] )\r\n\r\n字符串编码：\r\n\r\n71. md5(): 字符串md5编码\r\n<pre><code>\r\n$str = \"Hello\";\r\necho md5($str);\r\n</code></pre>\r\n数组函数\r\n\r\n数组创建：\r\n\r\n72.  array(): 生成一个数组\r\n<pre><code>\r\n$a=array(\"Dog\",\"Cat\",\"Horse\");\r\nprint_r($a);\r\n</code></pre>\r\n\r\n数组值或,键=>值一个数组型变量\r\n\r\n73.  array_combine(): 生成一个数组,用一个数组的值 作为键名,另一个数组值作为值\r\n<pre><code>\r\n    $a1=array(\"a\",\"b\",\"c\",\"d\");\r\n    $a2=array(\"Cat\",\"Dog\",\"Horse\",\"Cow\");\r\n    print_r(array_combine($a1,$a2));\r\n</code></pre>\r\n\r\n$a1为提供键,$a2提供值合成后的数组\r\n\r\n74. range(): 创建并返回一个包含指定范围的元素的数组。\r\n<pre><code>\r\n    $number = range(0,50,10);\r\n    print_r ($number);\r\n</code></pre>\r\n输入: 0是最小值,50是最大值,10是步长 \r\n\r\n输出: 合成后的数组\r\n\r\n75. compact(): 创建一个由参数所带变量组成的数组\r\n<pre><code>\r\n$firstname = \"Peter\";\r\n$lastname = \"Griffin\";\r\n$age = \"38\";\r\n$result = compact(\"firstname\", \"lastname\",\r\n\"age\");\r\nprint_r($result);\r\n</code></pre>\r\n变量或数组\r\n返回由变量名为键,变量值为值的数组,变量也可以为多维数组.会递归处理 \r\n\r\n76. array_fill(): 用给定的填充(值生成)数组\r\n\r\n<pre><code>$a=array_fill(2,3,\"Dog\");\r\nprint_r($a);\r\n</code></pre>\r\n\r\n2是键,3是填充的数量,\'Dog\'为填充内容返回完成的数组\r\n\r\n数组合并和拆分：　　　　\r\n\r\n77. array_chunk(): 把一个数组分割为新的数组块\r\n<pre><code>\r\n$a=array(\"a\"=>\"Cat\",\"b\"=>\"Dog\",\"c\"=>\"Horse\",\"d\"=>\"Cow\");\r\nprint_r(array_chunk($a,2));\r\n</code></pre>\r\n\r\n一个数组分割后的多维数组，规定每个新数组包含2个元素\r\n\r\n78. array_merge(): 把两个或多个数组合并为一个数组。\r\n<pre><code>\r\n$a1=array(\"a\"=>\"Horse\",\"b\"=>\"Dog\");\r\n$a2=array(\"c\"=>\"Cow\",\"b\"=>\"Cat\");\r\nprint_r(array_merge($a1,$a2));\r\n</code></pre>\r\n\r\n输入: 两个数组 \r\n\r\n输出: 返回完成后的数组\r\n\r\n79. array_slice(): 在数组中根据条件取出一段值，并返回。\r\n<pre><code>\r\n$a=array(0=>\"Dog\",1=>\"Cat\",2=>\"Horse\",3=>\"Bird\");\r\nprint_r(array_slice($a,1,2));\r\n</code></pre>\r\n\r\n输入: 一个数组 \r\n输出: 1为从\'Cat\'开始，2为返回两个元素\r\n\r\n数组比较：\r\n\r\n80. array_diff(): 返回两个数组的差集数组\r\n<pre><code>\r\n$a1=array(0=>\"Cat\",1=>\"Dog\",2=>\"Horse\");\r\n$a2=array(3=>\"Horse\",4=>\"Dog\",5=>\"Fish\");\r\n print_r(array_diff($a1,$a2)); //返回\'Cat\'\r\n</code></pre>\r\n\r\n输入: 两个或多个数组 \r\n输出: $a1与$a2的不同之处\r\n\r\n81. array_intersect(): 返回两个或多个数组的交集数组 \r\n\r\n输出: 返回\'Dog\'和\'Horse\',$a1与$a2的相同之处\r\n\r\n数组查找替换： 　　\r\n　　\r\n82. array_search(): 在数组中查找一个值，返回一个键，没有返回返回假\r\n<pre><code>\r\n$a=array(\"a\"=>\"Dog\",\"b\"=>\"Cat\",\"c\"=>\"Horse\");\r\necho array_search(\"Dog\",$a);\r\n</code></pre>\r\n输入: 一个数组 \r\n\r\n输出: 成功返回键名,失败返回false\r\n\r\n83. array_splice(): 把数组中一部分删除用其他值替代\r\n<pre><code>\r\n$a1=array(0=>\"Dog\",1=>\"Cat\",2=>\"Horse\",3=>\"Bird\");\r\n$a2=array(0=>\"Tiger\",1=>\"Lion\");\r\narray_splice($a1,0,2,$a2);\r\nprint_r($a1);\r\n</code></pre>\r\n输入: 一个或多个数组 \r\n\r\n输出: $a1被移除的部分由$a2补全\r\n\r\n84. array_sum(): 返回数组中所有值的总和\r\n<pre><code>\r\n$a=array(0=>\"5\",1=>\"15\",2=>\"25\");\r\necho array_sum($a);\r\n</code></pre>\r\n输入: 一个数组 输出: 返回和\r\n\r\n85. in_array(): 在数组中搜索给定的值,区分大小写\r\n<pre><code>\r\n$people = array(\"Peter\", \"Joe\", \"Glenn\", \"Cleveland\");\r\nif (in_array(\"Glenn\",$people) {\r\necho \"Match found\";\r\n}\r\nelse{\r\necho \"Match not found\";\r\n}\r\n</code></pre>\r\n\r\n输入: 需要搜索的值|数组 \r\n\r\n输出: true/false\r\n\r\n86. array_key_exists(): 判断某个数组中是否存在指定的 key\r\n\r\n输入: 需要搜索的键名|数组\r\n\r\n数组指针操作：\r\n\r\n87. key(): 返回数组内部指针当前指向元素的键名 　　　\r\n\r\n88. current(): 返回数组中的当前元素(单元). 　　　\r\n\r\n89. next(): 把指向当前元素的指针移动到下一个元素的位置,并返回当前元素的值 　　　\r\n\r\n90. prev(): 把指向当前元素的指针移动到上一个元素的位置,并返回当前元素的值 　　　\r\n\r\n91. end(): 将数组内部指针指向最后一个元素，并返回该元素的值(如果成功) 　　　\r\n\r\n92. reset(): 把数组的内部指针指向第一个元素，并返回这个元素的值 　　　\r\n\r\n93. list(): 用数组中的元素为一组变量赋值\r\n<pre><code>\r\n$my_array=array(\"Dog\",\"Cat\",\"Horse\");\r\nlist($a, $b, $c) = $my_array;\r\n</code></pre>\r\n输入: $a, $b, $c为需要赋值的变量 \r\n\r\n输出: 变量分别匹配数组中的值\r\n\r\n94. array_shift(): 删除数组中的第一个元素，并返回被删除元素的值\r\n<pre><code>\r\n$a=array(\"a\"=>\"Dog\",\"b\"=>\"Cat\",\"c\"=>\"Horse\");\r\necho array_shift($a);\r\nprint_r ($a);\r\n</code></pre>\r\n\r\n95. array_unshift(): 在数组开头插入一个或多个元素\r\n<pre><code>\r\n$a=array(\"a\"=>\"Cat\",\"b\"=>\"Dog\");\r\narray_unshift($a,\"Horse\");\r\nprint_r($a);\r\n</code></pre>\r\n\r\n96. array_push(): 向数组最后压入一个或多个元素\r\n<pre><code>\r\n$a=array(\"Dog\",\"Cat\");\r\narray_push($a,\"Horse\",\"Bird\");\r\nprint_r($a);\r\n</code></pre>\r\n输入: 目标数组|需要压入的值 返回值: 返回新的数组\r\n\r\n97. array_pop(): 取得（删除）数组中的最后一个元素\r\n<pre><code>\r\n$a=array(\"Dog\",\"Cat\",\"Horse\");\r\narray_pop($a);\r\nprint_r($a);\r\n</code></pre>\r\n输入: $a为目标数组 输出: 返回数组剩余元素\r\n\r\n数组键值操作: 　　　　\r\n\r\n98. shuffle(): 将数组打乱,保留键名\r\n<pre><code>\r\n$my_array = array(\"a\" => \"Dog\", \"b\" => \"Cat\");\r\nshuffle($my_array);\r\nprint_r($my_array);\r\n</code></pre>\r\n输入: 一个或多个数组 输出: 顺序打乱后的数组\r\n\r\n99. count(): 计算数组中的单元数目或对象中的属性个数\r\n<pre><code>\r\n$people = array(\"Peter\", \"Joe\", \"Glenn\",\r\n\"Cleveland\");\r\n$result = count($people);\r\necho $result;\r\n</code></pre>\r\n输入: 数组 输出: 输出元素个数\r\n\r\n100. array_flip(): 返回一个键值反转后的数组\r\n<pre><code>\r\n$a=array(0=>\"Dog\",1=>\"Cat\",2=>\"Horse\");\r\nprint_r(array_flip($a));\r\n</code></pre>\r\n输出: 返回完成后的数组 \r\n\r\n101. array_keys(): 返回数组所有的键,组成一个数组\r\n<pre><code>\r\n$a=array(\"a\"=>\"Horse\",\"b\"=>\"Cat\",\"c\"=>\"Dog\");\r\nprint_r(array_keys($a));\r\n</code></pre>\r\n输出: 返回由键名组成的数组\r\n\r\n102. array_values(): 返回数组中所有值，组成一个数组\r\n\r\n输出: 返回由键值组成的数组\r\n\r\n103. array_reverse(): 返回一个元素顺序相反的数组 元素顺序相反的一个数组，键名和键值依然匹配\r\n\r\n104. array_count_values(): 统计数组中所有的值出现的次数\r\n<pre><code>\r\n$a=array(\"Cat\",\"Dog\",\"Horse\",\"Dog\");\r\nprint_r(array_count_values($a));\r\n</code></pre>\r\n\r\n输出: 返回数组原键值为新键名，次数为新键值\r\n\r\n105. array_rand(): 从数组中随机抽取一个或多个元素,注意是键名!!!\r\n<pre><code>\r\n$a=array(\"a\"=>\"Dog\",\"b\"=>\"Cat\",\"c\"=>\"Horse\");\r\nprint_r(array_rand($a,1));\r\n</code></pre>\r\n$a为目标数组, 1为抽取第几个元素的键名返回第1个元素的键名b\r\n\r\n106. each(): 返回数组中当前的键／值对并将数组指针向前移动一步 调用array each ( array &$array )\r\n在执行 each() 之后，数组指针将停留在数组中的下一个单元或者当碰到数组结尾时停留在最后一个单元。\r\n\r\n如果要再用 each 遍历数组，必须使用 reset()。\r\n\r\n返回值: \r\n\r\n数组中当前指针位置的键／值对并向前移动数组指针。\r\n\r\n键值对被返回为四个单元的数组，键名为0，1，key和 value。\r\n\r\n单元 0 和 key 包含有数组单元的键名，1 和 value 包含有数据。 \r\n\r\n如果内部指针越过了数组的末端，则 each() 返回 FALSE。\r\n\r\n107. array_unique(): 删除重复值，返回剩余数组\r\n<pre><code>\r\n$a=array(\"a\"=>\"Cat\",\"b\"=>\"Dog\",\"c\"=>\"Cat\");\r\nprint_r(array_unique($a));\r\n</code></pre>\r\n输入: 数组\r\n\r\n 输入: 返回无重复值数组，键名不变\r\n\r\n数组排序: 　　\r\n\r\n108. sort(): 按升序对给定数组的值排序,不保留键名\r\n<pre><code>\r\n$my_array = array(\"a\" => \"Dog\", \"b\" => \"Cat\",\r\n\"c\" => \"Horse\");\r\nsort($my_array);\r\nprint_r($my_array);\r\n输出: true/false 　 \r\n</code></pre>\r\n\r\n109. rsort(): 对数组逆向排序,不保留键名　\r\n　 \r\n110. asort(): 对数组排序,保持索引关系　\r\n　　 \r\n111. arsort(): 对数组逆向排序,保持索引关　 \r\n\r\n112. ksort(): 系按键名对数组排序　 \r\n\r\n113. krsort(): 将数组按照键逆向排序 \r\n\r\n114. natsort(): 用自然顺序算法对数组中的元素排序 　\r\n　　 \r\n115. natcasesort(): 自然排序,不区分大小写　　　 \r\n　　\r\n文件系统函数\r\n\r\n116. fopen(): 打开文件或者 URL\r\n<pre><code>\r\n    $handle = fopen(\"ftp://user:password@example.com/somefile.txt\", \"w\");\r\n</code></pre>\r\n调用: resource fopen ( string filename, string mode [, bool use_include_path [, resource zcontext]] )\r\n\r\n返回值: 如果打开失败，本函数返回 FALSE\r\n\r\n117. fclose(): 关闭一个已打开的文件指针\r\n<pre><code>\r\n$handle = fopen(\'somefile.txt\', \'r\');\r\nfclose($handle);\r\nbool fclose(resource handle)\r\n</code></pre>\r\n输出: 如果成功则返回 TRUE，失败则返回 FALSE\r\n\r\n文件属性\r\n\r\n118. file_exists(): 检查文件或目录是否存在\r\n<pre><code>\r\n$filename = \'/path/to/foo.txt\';\r\nif (file_exists($filename)) {\r\necho \"exists\";\r\n} else {\r\necho \"does not exist\";\r\n}\r\n</code></pre>\r\n调用: bool file_exists ( string filename ) \r\n\r\n输入: 指定的文件或目录 输出: 存在则返回 TRUE，否则返回 FALSE\r\n\r\n119.  filesize(): 取得文件大小\r\n<pre><code>\r\n$filename = \'somefile.txt\';\r\necho $filename . \': \' . filesize($filename) .\'bytes\';\r\n</code></pre>\r\n调用: int filesize ( string $filename )\r\n\r\n输出: 返回文件大小的字节数，如果出错返回 FALSE 并生成一条 E_WARNING 级的错误\r\n\r\n120. is_readable(): 判断给定文件是否可读\r\n<pre><code>\r\n$filename = \'test.txt\';\r\nif (is_readable($filename)) {\r\necho \'可读\';\r\n} else {\r\necho \'不可读\';\r\n}\r\n</code></pre>\r\n调用: bool is_readable ( string $filename )\r\n\r\n 输出: 如果由 filename指定的文件或目录存在并且可读则返回 TRUE\r\n\r\n121. is_writable(): 判断给定文件是否可写\r\n<pre><code>\r\n$filename = \'test.txt\';\r\nif (is_writable($filename)) {\r\necho \'可写\';\r\n} else {\r\necho \'不可写\';\r\n}\r\n</code></pre>\r\n调用: bool is_writable ( string $filename ) filename 参数 可以是一个允许进行是否可写检查的目录名\r\n\r\n输出: 如果文件存在并且可写则返回 TRUE。\r\n\r\n122. is_executable(): 判断给定文件是否可执行\r\n<pre><code>\r\n$file = \'setup.exe\';\r\nif (is_executable($file)) {\r\necho \'可执行\';\r\n} else {\r\necho \'不可执行\';\r\n}\r\n</code></pre>\r\n调用: bool is_executable ( string $filename ) \r\n\r\n输出: 如果文件存在且可执行则返回 TRUE\r\n\r\n123. filectime(): 获取文件的创建时间\r\n<pre><code>\r\n$filename = \'somefile.txt\';\r\necho filectime($filename);\r\n</code></pre>\r\n调用: int filectime ( string $filename ) \r\n\r\n输出: 时间以 Unix 时间戳的方式返回，如果出错则返回FALSE\r\n\r\n124. filemtime(): 获取文件的修改时间\r\n<pre><code>\r\n$filename = \'somefile.txt\';\r\necho filemtime($filename);\r\n    int filemtime ( string $filename )\r\n</code></pre>\r\n输出: 返回文件上次被修改的时间，出错时返回 FALSE。时间以 Unix时间戳的方式返回\r\n\r\n125. fileatime(): 获取文件的上次访问时间\r\n<pre><code>\r\n$filename = \'somefile.txt\';\r\necho fileatime($filename);\r\n</code></pre>\r\n调用: int fileatime (string $filename)\r\n\r\n输出: 返回文件上次被访问的时间, 如果出错则返回FALSE. 时间以Unix时间戳的方式返回.\r\n\r\n126. stat(): 获取文件大部分属性值\r\n<pre><code>\r\n$filename = \'somefile.txt\';\r\nvar_dump(fileatime($filename));\r\n</code></pre>\r\n调用: array stat (string $filename 输出: 返回由 filename 指定的文件的统计信息\r\n\r\n文件操作\r\n\r\n127. fwrite(): 写入文件\r\n<pre><code>\r\n$filename = \'test.txt\';\r\n$somecontent = \"添加这些文字到文件\\n\";\r\n$handle = fopen($filename, \'a\');\r\nfwrite($handle, $somecontent);\r\nfclose($handle);\r\n</code></pre>\r\n调用: int fwrite ( resource handle, string string [, int length] )\r\n\r\n输出: 把 string 的内容写入 文件指针 handle 处。如果指定了 length,当写入了length个字节或者写完了string以后，写入就会停止, 视乎先碰到哪种情况\r\n\r\n128. fputs(): 同上　 　　\r\n\r\n129. fread(): 读取文件\r\n<pre><code>\r\n$filename = \"/usr/local/something.txt\";\r\n$handle = fopen($filename, \"r\");\r\n$contents = fread($handle, filesize($filename));\r\n fclose($handle);\r\n</code></pre>\r\n调用: string fread ( int handle, int length ) 从文件指针handle，读取最多 length 个字节\r\n\r\n130. feof(): 检测文件指针是否到了文件结束的位置\r\n<pre><code>\r\n$file = @fopen(\"no_such_file\", \"r\");\r\nwhile (!feof($file)) {\r\n}\r\nfclose($file);\r\n</code></pre>\r\n调用: bool feof ( resource handle ) \r\n\r\n输出: 如果文件指针到了 EOF 或者出错时则返回TRUE，否则返回一个错误（包括 socket 超时），其它情况则返回 FALSE\r\n\r\n131. fgets(): 从文件指针中读取一行\r\n<pre><code>\r\n$handle = @fopen(\"/tmp/inputfile.txt\", \"r\");\r\nif ($handle) {\r\nwhile (!feof($handle)) {\r\n$buffer = fgets($handle, 4096);\r\necho $buffer;\r\n}\r\nfclose($handle);\r\n}\r\n</code></pre>\r\n调用: string fgets ( int handle [, int length] ) \r\n\r\n输出: 从handle指向的文件中读取一行并返回长度最多为length-1字节的字符串.碰到换行符（包括在返回值中）、EOF 或者已经读取了length -1字节后停止(看先碰到那一种情况). 如果没有指定 length,则默认为1K, 或者说 1024 字节.\r\n\r\n132. fgetc(): 从文件指针中读取字符\r\n<pre><code>\r\n$fp = fopen(\'somefile.txt\', \'r\');\r\nif (!$fp) {\r\necho \'Could not open file somefile.txt\';\r\n}\r\nwhile (false !== ($char = fgetc($fp))) {\r\necho \"$char\\n\";\r\n}\r\n</code></pre>\r\n输入: string fgetc ( resource $handle ) \r\n\r\n输出: 返回一个包含有一个字符的字符串，该字符从 handle指向的文件中得到. 碰到 EOF 则返回 FALSE.\r\n\r\n133. file(): 把整个文件读入一个数组中\r\n<pre><code>\r\n$lines = file(\'http://www.example.com/\');\r\n// 在数组中循环，显示 HTML 的源文件并加上行号。\r\n \r\n foreach ($lines as $line_num => $line) {\r\n echo \"Line #<b>{$line_num}</b> : \" .\r\n htmlspecialchars($line) . \"<br />\\n\";\r\n }\r\n// 另一个例子将 web 页面读入字符串。参见 file_get_contents()。\r\n \r\n $html = implode(\'\', file(\'http://www.example.com/\'));\r\n</code></pre>\r\n调用: array file ( string $filename [, int $use_include_path [, resource $context ]] )\r\n\r\n输出: 数组中的每个单元都是文件中相应的一行，包括换行符在内。如果失败 file() 返回 FALSE\r\n\r\n134. readfile(): 输出一个文件　 调用: int readfile ( string $filename [, bool $use_include_path [, resource $context ]] )\r\n输出: 读入一个文件并写入到输出缓冲。返回从文件中读入的字节数。如果出错返回 FALSE\r\n\r\n135. file_get_contents(): 将整个文件读入一个字符串\r\n    echo file_get_contents(\'http://www.baidu.com\');</code></pre>\r\n调用: string file_get_contents ( string $filename [, bool $use_include_path [, resource $context [, int $offset [, int $maxlen ]]]] ) 　 \r\n\r\n136.file_put_contents():将一个字符串写入文件\r\n    file_put_contents(\'1.txt\',\'aa\');\r\n</code></pre>\r\n调用: int file_put_contents ( string $filename , string $data [, int $flags [, resource $context ]] )\r\n输出: 该函数将返回写入到文件内数据的字节数\r\n\r\n137. ftell(): 返回文件指针读/写的位置\r\n$fp=fopen(\'tx.txt\',\'r\');\r\nfseek($fp,10);\r\necho ftell($fp);\r\nfread($fp,4);\r\necho ftell($fp);\r\n</code></pre>\r\n调用: int ftell ( resource $handle ) \r\n\r\n输出: 返回由 handle 指定的文件指针的位置，也就是文件流中的偏移量\r\n\r\n138. fseek(): 在文件指针中定位\r\n$fp=fopen(\'tx.txt\',\'r\');\r\nfseek($fp,10);\r\necho ftell($fp);\r\nfread($fp,4);\r\necho ftell($fp);\r\n</code></pre>\r\n调用: int fseek ( resource $handle , int $offset [, int $whence ] ) \r\n\r\n输出: 成功则返回 0；否则返回 -1\r\n\r\n139. rewind(): 倒回文件指针的位置\r\n$fp=fopen(\'tx.txt\',\'r\');\r\nfseek($fp,3);\r\necho ftell($fp);\r\nfread($fp,4);\r\nrewind($fp);\r\necho ftell($fp);\r\n</code></pre>\r\n调用: bool rewind ( resource $handle ) \r\n返回值: 如果成功则返回 TRUE，失败则返回 FALSE\r\n\r\n140. flock(): 轻便的执行文件锁定\r\n$fp=fopen(\'tx.txt\',\'r\');\r\nflock($fp, LOCK_SH);//共享锁\r\n//flock($fp, LOCK_EX);//独立锁，写文件时用它打开\r\n//flock($fp, LOCK_NB);//附加锁\r\nflock($fp, LOCK_UN);//释放锁\r\nfclose($fp);\r\n</code></pre>\r\n调用: bool flock ( int $handle , int $operation [, int &$wouldblock ] ) \r\n\r\n输出: 如果成功则返回 TRUE，失败则返回 FALSE\r\n\r\n目录\r\n141. basename(): 返回路径中的文件名部分\r\npath = \"/home/httpd/html/index.php\";\r\n$file = basename($path);\r\n$file = basename($path,\".php\");\r\n</code></pre>\r\n调用: string basename ( string $path [, string $suffix ]) \r\n输出: 给出一个包含有指向一个文件的全路径的字符串，本函数返回基本的文件名。如果文件名是以 suffix 结 束的，那这一部分也会被去掉\r\n\r\n142. dirname(): 返回路径中的目录部分\r\n$path = \"/etc/passwd\";\r\n$file = dirname($path);\r\n</code></pre>\r\n调用: string dirname ( string $path ) \r\n\r\n输出: 给出一个包含有指向一个文件的全路径的字符串，本函数返回去掉文件名后的目录名\r\n\r\n143. pathinfo(): 返回文件路径的信息\r\necho \'<pre>\';\r\nprint_r(pathinfo(\"/www/htdocs/index.html\"));\r\necho \'</pre>\';\r\n</code></pre>\r\n调用: mixed pathinfo ( string $path [, int $options ] ) 返回一个关联数组包含有 path 的信息\r\n\r\n144. opendir(): 打开目录句柄\r\n$fp=opendir(\'E:/xampp/htdocs/php/study/19\');\r\necho readdir($fp);\r\nclosedir($fp);\r\n</code></pre>\r\n调用: resource opendir ( string $path [, resource $context ] )\r\n\r\n返回值: 如果成功则返回目录句柄的 resource，失败则返回FALSE\r\n\r\n145. readdir(): 从目录句柄中读取条目\r\n$fp=opendir(\'E:/xampp/htdocs/php/study/19\');\r\necho readdir($fp);\r\nclosedir($fp);\r\n</code></pre>\r\n调用: string readdir ( resource $dir_handle ) 返回值: 返回目录中下一个文件的文件名。文件名以在文件系统中的排序返回\r\n\r\n146. closedir(): 关闭目录句柄\r\n$fp=opendir(\'E:/xampp/htdocs/php/study/19\');\r\necho readdir($fp);\r\nclosedir($fp);\r\n</code></pre>\r\n调用: void closedir ( resource $dir_handle ) 关闭由 dir_handle 指定的目录流。流必须之前被opendir() 所打开 \r\n\r\n147. rewinddir() : 倒回目录句柄\r\n\r\n$fp=opendir(\'E:/xampp/htdocs/php/study/19\');\r\necho readdir($fp).\'<br />\';\r\necho readdir($fp).\'<br />\';\r\necho readdir($fp).\'<br />\';\r\nrewinddir($fp);\r\necho readdir($fp).\'<br />\';\r\nclosedir($fp);\r\n</code></pre>\r\n调用: void rewinddir ( resource $dir_handle ) \r\n\r\n输出: 将 dir_handle 指定的目录流重置到目录的开头 \r\n\r\n148. mkdir(): 新建目录\r\n    mkdir(\'123\');</code></pre>\r\n调用: bool mkdir ( string $pathname [, int $mode [, bool $recursive [, resource $context ]]] ) \r\n\r\n输出: 尝试新建一个由 pathname 指定的目录\r\n\r\n149. rmdir(): 删除目录\r\n   <pre><code> rmdir(\'123\');</code></pre>\r\n调用: bool rmdir ( string $dirname ) \r\n\r\n输出: 尝试删除 dirname 所指定的目录。\r\n\r\n目录必须是空的，而且要有相应的权限。如果成功则返回TRUE，失败则返回 FALSE\r\n\r\n150. unlink(): 删除文件\r\n<pre><code>\r\nunlink(\'123/1.txt\');\r\nrmdir(\'123\');\r\n</code></pre>\r\n\r\n调用: bool unlink ( string $filename ) 输出: 删除 filename 。和 Unix C 的 unlink() 函数相似。\r\n\r\n如果成功则返回 TRUE，失败则返回 FALSE\r\n\r\n151. copy(): 拷贝文件\r\n    <pre><code>copy(\'index.php\',\'index.php.bak\');</code></pre>\r\n调用: bool copy ( string $source , string $dest ) \r\n输出: 将文件从 source 拷贝到 dest. \r\n如果成功则返回TRUE，失败则返回 FALSE\r\n\r\n152. rename(): 重命名一个文件或目录\r\n<pre><code>  rename(\'tx.txt\',\'txt.txt\'); </code></pre>\r\n调用: bool rename ( string $oldname , string $newname [, resource $context ] ) 输出: 如果成功则返回 TRUE，失败则返回 FALSE\r\n文件的上传与下载\r\n\r\n153. is_uploaded_file():判断文件是否是通过 HTTP POST上传的\r\n<pre><code>\r\nif(is_uploaded_file($_FILES[\'bus\'][\'tmp_name\'])){\r\nif( move_uploaded_file($_FILES[\'bus\'][\'tmp_name\'],\r\n$NewPath) ){\r\necho \'上传成功<br /><img src=\"\'.$NewPath.\'\">\';\r\n}else{\r\nexit(\'失败\');\r\n}\r\n}else{\r\nexit(\'不是上传文件\');\r\n}\r\n调用: bool is_uploaded_file ( string $filename ) 　\r\n</code></pre>\r\n\r\n154. move_uploaded_file(): 将上传的文件移动到新位置\r\n<pre><code>\r\nif(is_uploaded_file($_FILES[\'bus\'][\'tmp_name\'])){\r\nif( move_uploaded_file($_FILES[\'bus\'][\'tmp_name\'],\r\n$NewPath) ){\r\necho \'上传成功<br /><img src=\"\'.$NewPath.\'\">\';\r\n}else{\r\nexit(\'失败\');\r\n}\r\n}else{\r\nexit(\'不是上传文件\');\r\n}\r\n</code></pre>\r\n调用: bool move_uploaded_file ( string $filename , string\r\n\r\n时间函数\r\n\r\n155. time(): 返回当前的 Unix 时间戳time(); \r\n\r\n调用: int time ( void ) \r\n\r\n输出: 返回自从 Unix 纪元（格林威治时间 1970 年 1 月 1 日 00:00:00）到当前时间的秒数\r\n\r\n156. mktime(): 取得一个日期的 Unix 时间戳\r\n<pre><code>\r\n    mktime(0, 0, 0, 4, 25, 2012);\r\n调用: int mktime ([ int $hour [, int $minute [, int $second [, int $month [, int $day [, int $year [, int $is_dst ]]]]]]] ) 　\r\n</code> </pre>\r\n\r\n156. date(): 格式化一个本地时间／日期\r\n<pre><code>\r\ndate(\'Y年m月d日 H:i:s\');\r\n调用: string date ( string $format [, int $timestamp ] )\r\n输出: 2016年09月10日 20:45:54\r\n</code></pre>\r\n\r\n157. checkdate(): 验证一个格里高里日期 调用: bool checkdate ( int $month , int $day , int $year) 输出: 如果给出的日期有效则返回 TRUE，否则返回 FALSE\r\n<pre><code>\r\nif(checkdate(6,31,2012)){\r\necho \'成立\';\r\n}else{\r\necho \'不成立\';\r\n}\r\n</code></pre>\r\n\r\n158. date_default_timezone_set(): 设定用于一个脚本中所有日期时间函数的默认时区\r\n    date_default_timezone_set(\'PRC\');\r\n调用: bool date_default_timezone_set ( string $timezone_identifier)\r\n返回值: 如果 timezone_identifier 参数无效则返回 FALSE，否则返回 TRUE。\r\n\r\n159. getdate(): 取得日期／时间信息 调用: array getdate ([ int $timestamp ] )\r\n输出: 返回一个根据timestamp得出的包含有日期信息的关联数组。如果没有给出时间戳则认为是当前本地时间\r\n\r\n\r\n$t=getdate();\r\nvar_dump($t);\r\n\r\n160. strtotime(): 将任何英文文本的日期时间描述解析为 Unix 时间戳\r\n<pre><code>\r\necho strtotime(\"now\");\r\nint strtotime ( string $time [, int $now ] ) 　\r\necho strtotime(\"10 September 2000\");\r\necho strtotime(\"+1 day\");\r\necho strtotime(\"+1 week\");\r\necho strtotime(\"+1 week 2 days 4 hours 2 seconds\");\r\necho strtotime(\"next Thursday\");\r\necho strtotime(\"last Monday\");\r\n</code></pre>\r\n\r\n161. microtime(): 返回当前 Unix 时间戳和微秒数 \r\n调用: mixed microtime ([ bool $get_as_float ] )\r\n<pre><code>\r\n$start=microtime(true);\r\nsleep(3);\r\n$stop=microtime(true);\r\necho $stop-$start;\r\n</code></pre>\r\n\r\n其他常用:\r\n\r\n162. intval(): 获取变量的整数值 调用: int intval ( mixed $var [, int $base = 10 ] ) 通过使用指定的进制 base 转换（默认是十进制），返回变量 var 的 integer 数值。 intval() 不能用于 object，否则会产生 E_NOTICE 错误并返回 1。\r\nvar: 要转换成 integer 的数量值\r\nbase: 转化所使用的进制\r\n返回值: 成功时返回 var 的 integer 值，失败时返回 0。 空的 array 返回 0，非空的 array 返回 1。\r\n\r\nPDO类的相关函数 prepare() execute() fetch()\r\n<pre><code>\r\n<?php\r\n$driver = \'mysql\';\r\n$database = \"dbname=CODINGGROUND\";\r\n$dsn = \"$driver:host=localhost;unix_socket=/home/cg/mysql/mysql.sock;$database\";\r\n \r\n$username = \'root\';\r\n$password = \'root\';\r\n \r\ntry {\r\n$conn = new PDO($dsn, $username, $password);\r\necho \"Database CODINGGROUND Connected\";\r\n}catch(PDOException $e){\r\n echo $e->getMessage();\r\n}\r\n$sql = \'SELECT * FROM users\';\r\n$stmt = $conn->prepare($sql);\r\n$stmt->execute();\r\n \r\necho \"<table style=\'width:100%\'>\";\r\nwhile($row = $stmt->fetch(PDO::FETCH_ASSOC)){\r\n echo \"<tr>\";\r\n foreach($row as $value)\r\n {\r\n echo sprintf(\"<td>%s</td>\", $value);\r\n }\r\n echo \"</tr>\";\r\n}\r\necho \"</table>\";\r\n</code></pre>\r\n\r\n正则表达式-元字符\r\n\r\n元字符及其匹配范围\r\n\r\n\\d 匹配任意一个十进制数字,\r\n\r\n等价于: [0-9] \\D 匹配除十进制数字以外的任意数字, \r\n\r\n等价于: [^0-9] \\s:匹配空白字符, \r\n\r\n等价于: [\\n\\f\\r\\t\\v] \r\n\r\n\\S: 匹配除空白字符以外的任意一个字符, 等价于[^\\n\\f\\r\\t\\v]\r\n\r\n\\w 匹配任意一个数字、字母和下划线,等价于: [0-9a-zA-Z_]\r\n\r\n \\W 匹配除字母、数字和下划线以外的任意字符, 等价于: [^0-9a-zA-Z_] \r\n\r\n[] \r\n1)用来表示范围。\r\n\r\n2)匹配任意一个中括号中定义的原子 　\r\n\r\n [^]: 中括号里面的^(抑扬符)：表示匹配任意一个除中括号里面定义的原子 限定次数\r\n\r\n* 匹配0次、1次或多次其前的原子, \r\n\r\n等价于: {0,} + 匹配1次或多次其前的原子, \r\n\r\n等价于: {1,} ? 匹配0次或1次其前的原子, \r\n\r\n等价于: {0,1} {n} 表示其前的原子正好出现n次, \r\n\r\n等价于: {n,} 表示其前的原子至少出现n次，最多不限制 　 \r\n\r\n{m,n} 表示其前的原子最少出现m次，最多出现n次 　\r\n\r\n其它\r\n\r\n. 匹配除换行符(\\n)以外的任意字符【windows下还匹配\\f\\r】\r\n　\r\n | 两个或多个分支选择【优先级最低】\r\n\r\n ^ 匹配输入字符的开始位置　 \r\n\r\n$ 匹配输入字符的结束位置\r\n \r\n\\b 匹配词边界　 \r\n\r\n\\B 匹配非词边界　\r\n\r\n () \r\n\r\n1)模式单元，把多个小原子组成一个大原子。\r\n\r\n2)可以改变优先级',4,13,1482734989,1482739212,0),(30,'ruby安装教程','下载ruby: \r\nhttps://dl.bintray.com/oneclick/rubyinstaller/rubyinstaller-2.3.1-x64.exe\r\n\r\n下载: https://dl.bintray.com/oneclick/rubyinstaller/DevKit-mingw64-64-4.7.2-20130224-1432-sfx.exe\r\n\r\n然后双击 rubyinstaller-2.3.1-x64.exe, \r\n\r\n选英文，然后下一步把复选框全选上\r\n\r\n然后解压DevKit-mingw64-64-4.7.2-20130224-1432-sfx.exe 到某个目录里面\r\n\r\n然后在cmd下面  进入Devkit的目录里面\r\n\r\n然后ruby dk.rb init\r\n\r\n然后ruby dk.rb install\r\n\r\n然后重点出现了，如果你在用gem命令安装的库的时候，遇到以下问题：\r\n\r\nError fetching https://ruby.taobao.org/: SSL_connect returned=1 errno=0 state=SSLv3 read server certificate B: certificate verify failed (\r\n\r\n请看此文档\r\nhttps://gist.github.com/huaiguoguo/f397f71542fbabf7ca3e36a4056d02aa',4,13,1482754990,1482755017,0),(31,'shell之学习笔记','shell命令用于和linux内核打交道，让我们运维服务器或者其它服务更方便\r\n\r\nshell有很多个版本，有cshell(以sun公司)  有kshell(商业)  有bash\r\n\r\nbash是shell的增强版本的， shell的扩展名可以是任意扩展名， 见面知意就好， 一般是以.sh为标准\r\n\r\nbash 文件的开头一般用：#!/bin/bash  或者  #!/bin/sh  开头  目的是为了告诉系统用bash或者sh执行\r\n\r\n变量的命名：your_name=\"我是变量\"  等于号两边不能有空隔    变量内容可以用单引号也可以用双引号，双引号解析变量，单引号不解析变量，我一般用双引号\r\n\r\n变量的使用：echo $your_name      或者   echo \"hello 你好 ${your_name}\"\r\n\r\n变量的重新赋值： your_name=\"我被重新赋值了\"\r\n\r\n只读变量：readonly your_name 只读变量不能被重新赋值或修改   也不能删除\r\n\r\n变量的删除：unset your_name  不能删除只读变量  删除变量之后就不能使用了，使用了的话，是空值\r\n\r\n变量字符串长度：  echo ${#your_name}\r\n\r\n截取变量字符串：echo ${your_name:1:4}\r\n\r\n查找字符串的位置：echo \\`expr index \"$your_name\" name\\`\r\n\r\nshell数组： my_array = (value1 value2 value3 value4 value5 valuen)\r\n\r\nshell数组的赋值：my_array[0]=\"我是第1个元素\"    my_array[1]=\"我是第2个元素\"\r\n\r\nshell数组元素的读取：one=${my_array[0]}              two=${my_array[1]}   \r\n\r\n获取shell数组的所有元素：all=${my_array[@]}\r\n\r\n取得数组元素的个数： length=${#array_name[@]}   或者  length=${#array_name[*]}\r\n\r\n取得数组单个元素的长度：length=${#array_name[n]}\r\n\r\n传递参数到shell脚本：\r\n我们可以在执行 Shell 脚本时，向脚本传递参数，脚本内获取参数的格式为：$n。n 代表一个数字，1 为执行脚本的第一个参数，2 为执行脚本的第二个参数，以此类推……\r\n<pre>\r\necho \"Shell 传递参数实例！\";\r\necho \"执行的文件名：$0\";\r\necho \"第一个参数为：$1\";\r\necho \"第二个参数为：$2\";\r\necho \"第三个参数为：$3\";\r\n\r\n$#      获取传递到脚本的参数个数      \r\n$*	  以一个单字符串显示所有向脚本传递的参数。以\"$1 $2 … $n\"的形式输出所有参数。\r\n$@      与$*相同，但是使用时加引号，并在引号中返回每个参数。\r\n$$	  脚本运行的当前进程ID号\r\n</pre>\r\n\r\n算术运算符：\r\n<pre>\r\n下表列出了常用的算术运算符，假定变量 a 为 10，变量 b 为 20：\r\n+	加法	`expr $a + $b` 结果为 30。\r\n-	减法	`expr $a - $b` 结果为 -10。\r\n*	乘法	`expr $a \\* $b` 结果为  200。\r\n/	除法	`expr $b / $a` 结果为 2。\r\n%	取余	`expr $b % $a` 结果为 0。\r\n=	赋值	a=$b 将把变量 b 的值赋给 a。\r\n==	相等。用于比较两个数字，相同则返回 true。	[ $a == $b ] 返回 false。\r\n!=	不相等。用于比较两个数字，不相同则返回 true。	[ $a != $b ] 返回 true。\r\n注意：条件表达式要放在方括号之间，并且要有空格，例如: [$a==$b] 是错误的，必须写成 [ $a == $b ]。\r\n\r\n\r\na=10\r\nb=20\r\n\r\nval=\\`expr $a + $b\\`\r\necho \"a + b : $val\"\r\n\r\nval=\\`expr $a - $b\\`\r\necho \"a - b : $val\"\r\n\r\nval=\\`expr $a \\* $b\\`\r\necho \"a * b : $val\"\r\n\r\nval=\\`expr $b / $a\\`\r\necho \"b / a : $val\"\r\n\r\nval=\\`expr $b % $a\\`\r\necho \"b % a : $val\"\r\n\r\nif [ $a == $b ]\r\nthen\r\n   echo \"a 等于 b\"\r\nfi\r\n\r\nif [ $a != $b ]\r\nthen\r\n   echo \"a 不等于 b\"\r\nfi\r\n\r\n</pre>\r\n\r\n关系运算符：\r\n<pre>\r\n-eq	检测两个数是否相等，相等返回 true。	[ $a -eq $b ] 返回 false。\r\n-ne	检测两个数是否相等，不相等返回 true。	[ $a -ne $b ] 返回 true。\r\n-gt	检测左边的数是否大于右边的，如果是，则返回 true。	[ $a -gt $b ] 返回 false。\r\n-lt	检测左边的数是否小于右边的，如果是，则返回 true。	[ $a -lt $b ] 返回 true。\r\n-ge	检测左边的数是否大于等于右边的，如果是，则返回 true。	[ $a -ge $b ] 返回 false。\r\n-le	检测左边的数是否小于等于右边的，如果是，则返回 true。	[ $a -le $b ] 返回 true。\r\n\r\na=10\r\nb=20\r\n\r\nif [ $a -eq $b ]\r\nthen\r\n   echo \"$a -eq $b : a 等于 b\"\r\nelse\r\n   echo \"$a -eq $b: a 不等于 b\"\r\nfi\r\n\r\n\r\nif [ $a -ne $b ]\r\nthen\r\n   echo \"$a -ne $b: a 不等于 b\"\r\nelse\r\n   echo \"$a -ne $b : a 等于 b\"\r\nfi\r\n\r\n\r\nif [ $a -gt $b ]\r\nthen\r\n   echo \"$a -gt $b: a 大于 b\"\r\nelse\r\n   echo \"$a -gt $b: a 不大于 b\"\r\nfi\r\n\r\n\r\nif [ $a -lt $b ]\r\nthen\r\n   echo \"$a -lt $b: a 小于 b\"\r\nelse\r\n   echo \"$a -lt $b: a 不小于 b\"\r\nfi\r\n\r\n\r\nif [ $a -ge $b ]\r\nthen\r\n   echo \"$a -ge $b: a 大于或等于 b\"\r\nelse\r\n   echo \"$a -ge $b: a 小于 b\"\r\nfi\r\n\r\n\r\nif [ $a -le $b ]\r\nthen\r\n   echo \"$a -le $b: a 小于或等于 b\"\r\nelse\r\n   echo \"$a -le $b: a 大于 b\"\r\nfi\r\n</pre>\r\n\r\n布尔运算符：\r\n<pre>\r\n\r\n下表列出了常用的布尔运算符，假定变量 a 为 10，变量 b 为 20：\r\n!	非运算，表达式为 true 则返回 false，否则返回 true。	[ ! false ] 返回 true。\r\n-o	或运算，有一个表达式为 true 则返回 true。	[ $a -lt 20 -o $b -gt 100 ] 返回 true。\r\n-a	与运算，两个表达式都为 true 才返回 true。	[ $a -lt 20 -a $b -gt 100 ] 返回 false。\r\n\r\na=10\r\nb=20\r\n\r\nif [ $a != $b ]\r\nthen\r\n   echo \"$a != $b : a 不等于 b\"\r\nelse\r\n   echo \"$a != $b: a 等于 b\"\r\nfi\r\n\r\nif [ $a -lt 100 -a $b -gt 15 ]\r\nthen\r\n   echo \"$a -lt 100 -a $b -gt 15 : 返回 true\"\r\nelse\r\n   echo \"$a -lt 100 -a $b -gt 15 : 返回 false\"\r\nfi\r\n\r\nif [ $a -lt 100 -o $b -gt 100 ]\r\nthen\r\n   echo \"$a -lt 100 -o $b -gt 100 : 返回 true\"\r\nelse\r\n   echo \"$a -lt 100 -o $b -gt 100 : 返回 false\"\r\nfi\r\n\r\nif [ $a -lt 5 -o $b -gt 100 ]\r\nthen\r\n   echo \"$a -lt 100 -o $b -gt 100 : 返回 true\"\r\nelse\r\n   echo \"$a -lt 100 -o $b -gt 100 : 返回 false\"\r\nfi\r\n\r\n</pre>\r\n\r\n逻辑运算符：\r\n<pre>\r\n以下介绍 Shell 的逻辑运算符，假定变量 a 为 10，变量 b 为 20:\r\n&&	逻辑的 AND	[[ $a -lt 100 && $b -gt 100 ]] 返回 false\r\n||	逻辑的 OR	[[ $a -lt 100 || $b -gt 100 ]] 返回 true\r\na=10\r\nb=20\r\n\r\nif [[ $a -lt 100 && $b -gt 100 ]]\r\nthen\r\n   echo \"返回 true\"\r\nelse\r\n   echo \"返回 false\"\r\nfi\r\n\r\nif [[ $a -lt 100 || $b -gt 100 ]]\r\nthen\r\n   echo \"返回 true\"\r\nelse\r\n   echo \"返回 false\"\r\nfi\r\n</pre>\r\n\r\n字符串运算符：\r\n<pre>\r\n下表列出了常用的字符串运算符，假定变量 a 为 \"abc\"，变量 b 为 \"efg\"：\r\n=	检测两个字符串是否相等，相等返回 true。	[ $a = $b ] 返回 false。\r\n!=	检测两个字符串是否相等，不相等返回 true。	[ $a != $b ] 返回 true。\r\n-z	检测字符串长度是否为0，为0返回 true。	[ -z $a ] 返回 false。\r\n-n	检测字符串长度是否为0，不为0返回 true。	[ -n $a ] 返回 true。\r\nstr	检测字符串是否为空，不为空返回 true。	[ $a ] 返回 true。\r\n\r\na=\"abc\"\r\nb=\"efg\"\r\n\r\nif [ $a = $b ]\r\nthen\r\n   echo \"$a = $b : a 等于 b\"\r\nelse\r\n   echo \"$a = $b: a 不等于 b\"\r\nfi\r\n\r\nif [ $a != $b ]\r\nthen\r\n   echo \"$a != $b : a 不等于 b\"\r\nelse\r\n   echo \"$a != $b: a 等于 b\"\r\nfi\r\n\r\nif [ -z $a ]\r\nthen\r\n   echo \"-z $a : 字符串长度为 0\"\r\nelse\r\n   echo \"-z $a : 字符串长度不为 0\"\r\nfi\r\n\r\nif [ -n $a ]\r\nthen\r\n   echo \"-n $a : 字符串长度不为 0\"\r\nelse\r\n   echo \"-n $a : 字符串长度为 0\"\r\nfi\r\n\r\nif [ $a ]\r\nthen\r\n   echo \"$a : 字符串不为空\"\r\nelse\r\n   echo \"$a : 字符串为空\"\r\nfi\r\n\r\n</pre>\r\n\r\n文件测试运算符：\r\n<pre>\r\n-b file	检测文件是否是块设备文件，如果是，则返回 true。	        [ -b $file ] 返回 false。\r\n-c file	检测文件是否是字符设备文件，如果是，则返回 true。	[ -c $file ] 返回 false。\r\n-d file	检测文件是否是目录，如果是，则返回 true。	                [ -d $file ] 返回 false。\r\n-f file	检测文件是否是普通文件（既不是目录，也不是设备文件），如果是，则返回 true。 [ -f $file ] 返回 true。\r\n-g file	检测文件是否设置了 SGID 位，如果是，则返回 true。	               [ -g $file ] 返回 false。\r\n-k file	检测文件是否设置了粘着位(Sticky Bit)，如果是，则返回 true。	[ -k $file ] 返回 false。\r\n-p file	检测文件是否是有名管道，如果是，则返回 true。	        [ -p $file ] 返回 false。\r\n-u file	检测文件是否设置了 SUID 位，如果是，则返回 true。	[ -u $file ] 返回 false。\r\n-r file	检测文件是否可读，如果是，则返回 true。	        [ -r $file ] 返回 true。\r\n-w file	检测文件是否可写，如果是，则返回 true。	        [ -w $file ] 返回 true。\r\n-x file	检测文件是否可执行，如果是，则返回 true。	[ -x $file ] 返回 true。\r\n-s file	检测文件是否为空（文件大小是否大于0），不为空返回 true。	[ -s $file ] 返回 true。\r\n-e file	检测文件（包括目录）是否存在，如果是，则返回 true。	[ -e $file ] 返回 true。\r\n\r\nfile=\"/var/www/runoob/test.sh\"\r\n\r\nif [ -r $file ]\r\nthen\r\n   echo \"文件可读\"\r\nelse\r\n   echo \"文件不可读\"\r\nfi\r\n\r\nif [ -w $file ]\r\nthen\r\n   echo \"文件可写\"\r\nelse\r\n   echo \"文件不可写\"\r\nfi\r\n\r\nif [ -x $file ]\r\nthen\r\n   echo \"文件可执行\"\r\nelse\r\n   echo \"文件不可执行\"\r\nfi\r\n\r\nif [ -f $file ]\r\nthen\r\n   echo \"文件为普通文件\"\r\nelse\r\n   echo \"文件为特殊文件\"\r\nfi\r\n\r\nif [ -d $file ]\r\nthen\r\n   echo \"文件是个目录\"\r\nelse\r\n   echo \"文件不是个目录\"\r\nfi\r\n\r\nif [ -s $file ]\r\nthen\r\n   echo \"文件不为空\"\r\nelse\r\n   echo \"文件为空\"\r\nfi\r\n\r\nif [ -e $file ]\r\nthen\r\n   echo \"文件存在\"\r\nelse\r\n   echo \"文件不存在\"\r\nfi\r\n\r\n</pre>\r\n\r\n\r\n\r\n',4,13,1484198100,1484202040,0);
